INSERT INTO `BRAND` VALUES (1,'Management 3.0',22,'MGT30','MGT30','How do I deal with my crappy organization? I like my work but I don’t like what our management is doing. What can I do?\r\n\r\nYou have come to the right place! The goal of Management 3.0 is to help you grow and transform organizations into becoming great places to work. We do that with inspiring events, effective courses, and practical books and exercises.\r\n\r\n”But, I’m not a manager”, you say? So what? We believe that management is not only the managers’ responsibility. It is everyone’s job! Therefore, Management 3.0 is not only about what managers can do, but also about what other workers can do.\r\n\r\nSo, if you want your workplace to be happy and healthy, what’s keeping you?','brands/6ed4858b03e7497b61b4b8e05691a5f1960d063f.png',1,'Better management with fewer managers','http://www.management30.com/',NULL,NULL,1,'2013-09-26 15:14:15','','2015-10-10 15:30:55','Jurgen Appelo'),(3,'Dare',26,'DARE','darefestival','At DARE, we\'re a global community of creative event organizers working together to create a fantastic experience for everyone, participants, speakers, sponsors, but also ourselves.','brands/dc7b740445bcde08e911599fd6bb6be05d242865.png',0,'More Happy Workers!','http://www.darefest.org/',NULL,NULL,0,'2013-09-26 15:14:15','Jurgen Appelo','2014-10-10 10:37:22','Sergey Kotlov'),(4,'Happy Melly Express',27,'HMEX','HMEX',NULL,'brands/95af222d87176d025f282e6f0183e5781f427614.png',0,NULL,'http://hmexpress.happymelly.com/','http://www.happymelly.com',NULL,1,'2013-09-26 15:14:15','Jurgen Appelo','2014-09-12 11:55:28','Sergey Kotlov'),(5,'Collaboration Superpowers',28,'CS','collaborationsuperpowers','Everyone who collaborates faces the problem of how to bridge the distance between two or more minds, whether you’re in the same building – or on the other side of the world. Rising to the challenges, remote work promotes some of the very things global business is seeking today including high levels of engagement and self-organization.\r\n\r\nCollaboration Superpowers collects stories, tips and lessons learned for setting up effective distributed teams. ','brands/3856600f0f52daeeb1a91f5b937a7deb0e5a27f5.png',0,'Working together from anywhere','http://www.collaborationsuperpowers.com/','http://www.collaborationsuperpowers.com/stories/',NULL,1,'2013-09-26 15:14:15','Jurgen Appelo','2014-11-10 16:16:36','Lisette Sutherland'),(6,'Business Transformers',29,'BT','BT',NULL,NULL,0,NULL,NULL,NULL,NULL,0,'2013-09-26 15:14:15','Jurgen Appelo','2014-09-30 06:48:54','Sergey Kotlov'),(8,'Happy Melly',22,'HM','HM',NULL,NULL,0,NULL,NULL,NULL,NULL,1,'2014-02-04 11:39:13','Jurgen Appelo','2014-02-04 11:39:13','Jurgen Appelo'),(9,'WIKISPEED',114,'WKSPD','WKSPD',NULL,NULL,0,NULL,NULL,NULL,NULL,0,'2014-02-25 07:00:43','Sergey Kotlov','2014-09-30 06:50:09','Sergey Kotlov'),(10,'Kudobox',25,'KUDOB','kudobox','Many researches show that small and fast token of appreciation is much more efficient than big but rare bonus. **In most cases a simple *Thank you* is enough.** However being thanked through a chat window or an email is not the same as being thanked in person. We lose an eyes’ contact, a timbre of voice, a face expression. \r\n\r\nLuckily we could partially compensate all this by **investing more efforts into our appreciations** than simply typing a few letters. **Kudobox** is here to help you with it.  \r\n\r\nWith Kudobox you could create ***a wonderfully looking appreciation card in a matter of seconds.*** Share it on Twitter or send a direct link and **bring your *Thank you* to a new level**.','brands/ca4a2211d4d0ceb63e2c477890b231661496f6ee.png',0,'The Easiest Way To Share Your Appreciations','http://kudobox.co/','http://kudobox.co/blog',NULL,1,'2014-03-13 11:36:52','Sergey Kotlov','2014-09-15 12:29:15','Hannu Heljala'),(11,'Learning 3.0',33,'LRN30','LRN30','Learning 3.0 rethink concepts, present stories and discuss opportunities that allow us to understand the role of learning in our lives. Their publications, tools and events will help you to learn in an emergent and continuous way, providing all we need to succeed as creative workers in this new era.','brands/93847517b55a19562a820f3c21f262c6432cd207.png',0,'Reinventing the Way Creative Workers Learn',NULL,NULL,NULL,1,'2014-05-18 07:58:29','Sergey Kotlov','2015-08-22 19:21:28','Alexandre Magno'),(12,'PeerUp!',32,'PERUP','peerup','We create small tools to improve peer to peer communication and evaluation within your environment.','brands/09438da49fe571b1712de98984f0aa818d9dc166.png',0,'Because Colleagues Know Best!',NULL,NULL,NULL,0,'2014-06-03 18:05:14','Jurgen Appelo','2014-09-15 18:09:01','Philipp Engstler'),(13,'Happy Remote Melly',34,'HMAU1','happyremotemelly','Telepresence robots and apps for remote working','brands/e68381737c34cd468a684781839f888bf5873482.png',0,'Tools, technology and training for happy remote working','http://www.happymelly.com.au',NULL,NULL,0,'2014-10-10 09:45:46','Sergey Kotlov','2014-10-16 04:50:46','Anton Rossouw'),(14,'Lean Change Management',53,'LCM','LeanChange','There is one constant in today\'s world. Change. Lean Change Management is a collection of books, videos, and workshops that will help you modernize your toolkit for introducing and managing change.\r\n\r\nLean Change Management combines ideas from Lean Startup, Change Management and Agile so you can create a movement in your organization.','brands/1c72361e59014bae4c344b668c2275deb5216ef5.png',1,'Innovative Practices for Managing Organizational Change','http://leanchange.org/','http://leanchange.org/blog/',NULL,1,'2015-03-10 12:02:12','Jurgen Appelo','2015-03-10 14:50:19','jasonlittle'),(15,'ImprovAgility',117,'IA','ImprovAgility','“When you get past doing agile (the practices) to being agile (the mindset and behaviors), you find that agile, adaptive and Lean approaches are more about self-organization, innovation, disruptive thinking, fast learning, constant feedback, interpersonal dynamics, and culture.” - Jim Highsmith\r\n\r\nIn the Creative Economy businesses must have the ability to effectively adapt and flourish within a disrupted, fast changing, and competitive landscape.  And flourishing in the creative economy will require individuals, teams and organizations that are Agile. Well, how do we train to Be Agile?  \r\n\r\nImprovisational Theater develops the human mindset and behaviors that produce spontaneity, creativity, responsiveness and invention.  These same characteristics and skills developed in Improvisational Theater can be applied in the world of work to build Agility.\r\n\r\nImprovAgility is a program that uses experiential learning techniques, derived from Improvisational Theater, to provide a wonderful training experience that is fun, lively, engaging and leaves a lasting impact.  The ImprovAgility workshops meet that challenge of training for Agility by exploring the characteristics of being Agile and engaging the participants in great improvisational exercises that develop Agility.','brands/0446933697c0f030f40e80ab578e6b5760ee5d91.png',0,'Training for Agility in the Creative Economy','http://improvagility.com','http://improviseandadapt.com',NULL,1,'2015-06-07 14:12:19','Jurgen Appelo','2015-06-14 05:01:54','showVALUE'),(16,'Improvement21',121,'IMP21','improvement21',NULL,NULL,0,NULL,NULL,NULL,NULL,1,'2015-09-22 20:59:04','Sergey Kotlov','2015-09-22 20:59:04','Sergey Kotlov');
