INSERT INTO `ENDORSEMENT` VALUES (1,53,0,'Lean Change Management review: Changing yourself is difficult. Changing an organization? One might say impossible. And, Jason has written a handbook that allows you to consider ways to implement the impossible.\r\n\r\nWith the idea of feedback-focused change, you can change an organization, one small step at a time. He\'s done it. You can do it. Let him show you what works and what doesn\'t.\r\n\r\nI love the stories. They ring true and follow what I know about change and people.','Johanna Rothman','Author, Speaker and Consultant',1,0,NULL),(2,121,0,'As a trainer, coach, consultant and author on Lean and Agile who has travelled four continents and worked with hundreds of companies worldwide, I\'ve seldom found people with a deeper understanding of these topics than Andrea. She has treasured an incredible amount of experience transforming big and medium enterprises to continuously improve. I\'ve worked with Andrea in projects at Europe and Israel, and I\'m always looking forward to new opportunities to collaborate. She\'s definitively a powerful change agent and a thought leader who can transform your organization and move your culture to a new level. ','Angel Medinilla','Agile Consultant, Trainer, Founder of Proyectalis',2,0,NULL),(3,121,0,'Andrea coached and trained our Services mid-management team in Lean and Six Sigma practices over the period of 10 months in our offices in the UK, US and Hong Kong. She has a solid knowledge of Lean and Six Sigma principles and practices and she was able to transfer knowledge to our team effectively.\r\nAndrea also developed training materials and delivered training on Lean for our Global Executive team. \r\nThe training gave a good introduction to the principles of lean via plenty of group discussions and games. Andrea\'s delivery style was easy to follow and professional.','Andrew G.','Head of Operations, Global Telecom',3,0,NULL),(5,29,1,'Real-Life experience.','Johan Oskarsson',NULL,1,972,9),(6,29,1,'Energigivande och lyhörd.','Johan Oskarsson',NULL,2,971,8),(7,29,1,'He was clear, pedagogic, had his own practical experience.','Johan Oskarsson',NULL,3,968,8),(8,29,1,'Knowledgeable, good natural speaker.','Johan Oskarsson',NULL,4,969,9),(12,90,1,'Good presentation skills, catchy drawings on flipcharts. Technical background with own experience in management positions.','Christof Braun',NULL,1,991,9),(13,22,1,'Jurgen was awesome even without luggage, materials and after a very long flight. It is impressive how professional he could be. I\'d never been able to perform that well under such conditions.','Felipe Suslik',NULL,3,151,10),(14,22,1,'Great depth of knowledge and a great story-teller with so many real-life stories that help put the tools in context.','Nancy Mayer',NULL,1,340,10),(15,22,1,'A lot of experience in the field, interesting examples, funny anecdotes. Very authentic.','Mirko Sonntag',NULL,2,698,10),(16,170,1,'Good background concerning Management. Good capability to improoving  client\'s static way of thinking to one in which complexity have more to do with improovement them trouble.','Rodrigo de Toledo',NULL,1,1003,9),(17,668,1,'Presence. Experience. Listening.','Marc-André Langlais',NULL,1,1005,8),(18,68,1,'I like Mads\' easy way to inspect and adapt during a course','Mads Troels Hansen',NULL,1,997,7),(19,68,1,'Mads did a fantastic job and understood when to change pace or context. Also his understanding of and practical experience with Mgmt 3.0 helped a lot.','Mads Troels Hansen',NULL,2,998,9),(20,68,1,'Very experienced, so could realte to specific cases and experiences. Very well prepared and structured. Calm and with a steady pase...','Mads Troels Hansen',NULL,3,996,8),(21,68,1,'Knowingly, experienced in SCRUM, good facilitation skills, high energy level, persistent','Mads Troels Hansen',NULL,4,999,8),(23,90,1,'Christof is highly experienced, authentic, a very good trainer and he supports a good atmosphere for discussing','Christof Braun',NULL,2,486,9),(24,159,1,'good story telling, strong visualization skills, calm and professional attitude ','Robert Wiechmann',NULL,1,878,8),(25,159,1,'big treasure trove of experience, great coach, great communication skills','Christian Bieschke',NULL,2,897,9),(26,159,1,'Judith hat einen enormen Schatz an Erfahrungen und dadurch viele gute Beispiele.  Sie ist sehr sympathisch und hatte für jedes Problem der  Teilnehmer viele mögliche agile Lösungen.','Tim Müller',NULL,3,879,9),(27,121,1,'Andrea and Ryan managed to facilitate the workshop without making me feel „lectured“. I really enjoyed this approach as it was based on an active dialogue in the group rather than a presented monologue.\r\nBoth are very knowledgeable and at the same time didn’t have the “I know best/all” attitude. \r\nWith their open and friendly personalities, both managed to build instant relationship and I felt very comfortable to share and learn from the others.\r\n','Martin  Schillig',NULL,4,976,10),(30,121,1,'Very knowledgeable and competent facilitators:\r\n- achieved almost full participation\r\n- good storytelling','Matthijs de Booij',NULL,5,977,8),(31,90,1,'Erfahrung und vollem Überblick über Management 3.0','Christof Braun',NULL,3,1049,9),(32,219,1,'pedagogue, funny and organized','Jean-Luc MAZE',NULL,1,1059,9),(33,219,1,'broad experience that allow him to give example, and is himself passionnated by the 3.0','Jean-Luc MAZE',NULL,2,1058,9),(34,219,1,'broad experience that allow him to give example, and is himself passionnated by the 3.0','Jean-Luc MAZE',NULL,3,1058,9),(35,40,1,'very patient, flexible and focused on clients needs and wishes','Jürgen Dittmar',NULL,1,1066,7),(36,40,1,'Seine ruhige und gelassene Art, sowie seine Souveränität.\r\nIch habe viele Trainer kennen gelernt, die verzweifelt versucht haben, einen Kurs in eine Richtung zu drängen, was sehr stressig war. Jürgen hat eindrucksvoll bewisen wir man einen Kurs ganz sanft leiten kann, ohne Druck.\r\nDas hat super Spaß gemacht.','Jürgen Dittmar',NULL,2,1067,10),(37,40,1,'Reichhaltiger Erfahrungsschatz im Management und Leadership, sehr angenehme Vortragsweise und Praxiselemente','Jürgen Dittmar',NULL,3,1050,9),(38,40,1,'Ruhe und Professionalität der gesamten Durchführung. Jürgen ist ruhig ohne langweilig zu sein und er ist dabei in einer faszinierenden Weise präzise und konkret. ','Jürgen Dittmar',NULL,4,1041,8),(39,53,14,'Very engaging.  I liked the gentle pace and flexibility to explore different topics.  Most courses cram too much in so that attendees don\'t absorb anything.','Jason Little',NULL,2,1069,9),(40,30,1,'Good stories and background knowledge. Very good knowledge on agile methods and practices.','Martin Lofgren',NULL,1,105,9),(41,30,1,'Johan was outstanding in his storytelling and kept all our focus through out the course. good mix of theory and his own experiences to underline key points and enough practises to make us think. \r\n','Andreas Emmoth',NULL,2,607,9),(42,30,1,'He was both personal and professional and well exceperince from irl. Very good!','karolina jörlin',NULL,3,610,9),(43,30,1,'I found that Johan Nyberg really had experience of work related to the area of transformation and was relation oriented with a genuine interest of the Agile-philosophy of management. ','Ciro  Flores',NULL,4,613,10),(44,30,1,'Really good to hear real case experience from existing business','Jonny Axelsson',NULL,5,617,10),(45,30,1,'He had done it himself, so good examples from real life.','Fredrik Husander',NULL,6,804,9),(46,30,1,'Mycket bra på att leverera budskap, så att det blev enkelt och övertygande. Bra att övningarna var korta.','Karin  Börnke',NULL,7,143,9),(47,30,1,'Very experienced leader, structured, fun to listen to','Johanna Smeshammar',NULL,8,149,9),(48,30,1,'Broad experience in practical management.','Ramūnas Skliutas',NULL,9,344,9),(49,30,1,'Very proffesional and experienced','Paulius Skeivelas',NULL,10,223,10),(50,30,1,'Very experienced and thoughtful facilitator, I liked the calmness and the structured way of working with us. Excellent story teller','Vaidas Kavaliunas',NULL,11,226,9),(51,30,1,'Johan shows a very good ability to reconnect with his experience in various management positions and apply that experience in his way of conveying the course.','Anders  Höglund',NULL,12,234,9),(52,30,1,'Very inspiring!','Bo Anell',NULL,13,478,9),(53,30,1,'Responsiveness to the group and, as I experienced, adjustments according to the groups maturity and will to have an open dialogue.','Emanuel Hasselvärn',NULL,14,479,9),(54,30,1,'He led us through the course with a steady and warm hand.','Lotta Plahn',NULL,15,480,9),(55,30,1,'I think the fact that he had a lot of experience in the field really helped to \"take him seriously\". The information we receieved seemed well grounded in real life.','martin blixt',NULL,16,481,9),(56,30,1,'Great facilitator, good neraity with games and stories','Therese Jonsson',NULL,17,484,9),(57,30,1,'Competent, social and enthusiastic  ','Erik Stark',NULL,18,369,9),(58,30,1,'Very likeable and alert paired with good knowledge of the subject matter.','Per Lindberger',NULL,19,370,9),(59,30,1,'I like the presentations he made and he seemed to have a lot of knowledge in the area and from real life which adds more value compared to if it\'s only theoretical knowledge.   ','Lars-Ove Lund',NULL,20,873,10),(60,30,1,'Really good story teller and a lot of experience to share','Torbjörn  Vading',NULL,21,880,9),(61,40,1,'Jürgen has an enormous knowledge of all Management 3.0 topics and a lot of experience working as a manager. These qualities combined with his calm and strong personality makes one awesome trainer. ','Jürgen Dittmar',NULL,5,1071,10),(63,1177,1,'He\'s very interactive and the whole workshop did not bore me.\r\nHe kept on keeping us in check of the time and next topics so we\'re always aligned with what\'s going on and what\'s to come.\r\nHe also immediately addressed some of the items from the Happiness Board.','Mary Anne Legaspi',NULL,1,1080,10),(64,1177,1,'He makes sure everyone is participating, everyone gets heard. Answers all our questions with integrity. Clear in all his statements.','Joyce Austria',NULL,2,1079,8),(65,166,1,'Very open to discussion, and it was very interactive. ','Stéphane Rondal',NULL,1,1085,6),(66,166,1,'Good knowledge of subject, personnal examples of situation','Stéphane Rondal',NULL,2,1084,9),(68,25,1,'Communicative, open to suggestions','Tadeusz Rzeźniczak',NULL,1,602,9);
