  `STATUS` tinyint(4) NOT NULL DEFAULT '1',
  `HANDLED` date DEFAULT NULL,
  `CONFIRMATION_ID` char(64) COLLATE utf8_unicode_ci DEFAULT NULL,
  `CREATED` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
