INSERT INTO `EVALUATION` VALUES (3,476,180,'Ich habe mich schon lange mit Agilität beschäftigt und suche immer weitere Hilfestellungen, Praxistipps, Argumente um meine Kollegen zu überzeugen.','action items','Mir fällt nichts ein. Ich fand das eine sehr interessante und gelungene Mischung.','facilitator review','changes to host',9,10,'Ich habe keine Verbesserungsvorschläge.',1,'2015-01-08',NULL,'2015-01-07 22:55:01','Sergey Kotlov','2015-01-07 22:55:01','Sergey Kotlov',NULL,NULL),(4,476,179,'Wie überzeuge ich das Management und wie kann ich das Management verstehen.','action items','nichts','facilitator review','changes to host',9,10,'?',1,'2015-01-08',NULL,'2015-01-08 12:08:24','Sergey Kotlov','2015-01-08 12:08:24','Sergey Kotlov',NULL,NULL),(5,473,187,'wanted to learn about new way to manage team','action items','more examples, videos','facilitator review','changes to host',10,10,'more activities, case studies',1,'2015-01-14',NULL,'2015-01-14 16:12:31','Sergey Kotlov','2015-01-14 16:12:31','Sergey Kotlov',NULL,NULL),(6,496,188,'O reconhecimento da certificação M3.0 no Brasil e a busca por ferramentas para gestão de conflitos e pessoas.','action items','Ter o material disponível para compra (livro, baralhos, etc)','facilitator review','changes to host',10,10,'Foi um curso ótimo e teve a continuidade com o workshop no dia seguinte, não vejo pontos de melhoria para esse evento.',1,'2015-01-14',NULL,'2015-01-14 18:01:40','Sergey Kotlov','2015-01-14 18:01:40','Sergey Kotlov',NULL,NULL),(7,464,189,'Better manage my Team and Coach my organisation ','action items','One day more','facilitator review','changes to host',8,10,'None',1,'2015-01-31',NULL,'2015-01-16 14:08:05','Sergey Kotlov','2015-01-16 14:08:05','Sergey Kotlov',NULL,NULL),(8,284,190,'Interested in Management 3.0','action items','One day more to go more into detail. Or extra deep dive days.','facilitator review','changes to host',9,9,'NO idea',1,'2015-01-17',NULL,'2015-01-17 12:17:08','Sergey Kotlov','2015-01-1