es to host',8,8,'Distribute few links with sources of basic information about management 3.0 prior to the event. The participants would prepare themselves better and would be able to spend more time for practical discussions during the event.',1,'2015-01-18',NULL,'2015-01-18 12:36:38','Sergey Kotlov','2015-01-18 12:36:38','Sergey Kotlov',NULL,NULL),(16,480,198,'colleague','action items','make the course a bit longer. like 2 and 1/2 day, maybe 3 days with some new modules?','facilitator review','changes to host',9,8,'would be great to keep current level of the discussions',1,'2015-02-03',NULL,'2015-01-19 13:39:51','Sergey Kotlov','2015-01-19 13:39:51','Sergey Kotlov',NULL,NULL),(17,485,210,'i was also reading about new management strategies comply with agile mindset,and i thought that this event will be a right choice to learn more about new dynamics.Was really helpful.','action items','more real life case studies &examples and more inspiring stories would be great','facilitator review','changes to host',9,9,'more inspritional stories,maybe fiction games',1,'2015-01-21',NULL,'2015-01-20 10:59:24','Sergey Kotlov','2015-01-20 10:59:24','Sergey Kotlov',NULL,NULL),(18,485,211,'As a marketing professional, I had the insight of managers worrying about losing their jobs during Agile transition. I attended the training to get a counter argument.','action items','The presentation can be more flowing.','facilitator review','changes to host',7,10,'http://rciis.ca/s-t-a-r-accent-reduction/',1,'2015-01-21',NULL,'2015-01-20 11:09:01','Sergey Kotlov','2015-01-20 11:09:01','Sergey Kotlov',NULL,NULL),(19,485,204,'I\\\'m trying to be a good Agile Coach. We\\\'re helpin to change the developers\\\' view but the managers view are also important. They have to support this process. The formation of the corporate culture is important. Then, I\\\'ve thought this training shows a different view and brings a new vision.','action items','The training content was very rich. The real case studies can be added.','facilitator review','changes to host',9,10,'I do not know',1,'2015-01-21',NULL,'2015-01-20 11:16:11','Sergey Kotlov','2015-01-20 11:16:11','Sergey Kotlov',NULL,NULL),(20,485,209,'I read the management 3.0 book. I loved the topics inside the book and I wanted to learn more. That triggered me for this event.','action items','Real time extreme management issues can be added as samples.','facilitator review','changes to host',9,9,'Due to the name of the cource, the expectations of attendees become higher or different that the original schedule. So at the beginning of the course, I advice the facilitators to define what will be explained in the training. That will be helpful to set the expectations on the correct path.',1,'2015-01-21',NULL,'2015-01-20 12:45:21','Sergey Kotlov','2015-01-20 12:45:21','Sergey Kotlov',NULL,NULL),(21,485,207,'Curiosity','action items','Associate with more hands-on experience','facilitator review','changes to host',7,6,'Real life experience ',1,'2015-01-21',NULL,'2015-01-20 12:49:24','Sergey Kotlov','2015-01-20 12:49:24','Sergey Kotlov',NULL,NULL),(22,16,212,'Umstellungen im Softwareentwicklungsprozess, Optimierungen im Job, Empfehlungen von Kollegen.','action items','Eventuell das Management 3.0 Buch vor der Veranstaltung versenden, Einsteigern würden die ersten Schritte somit denke ich leichter fallen.','facilitator review','changes to host',9,10,'./.',1,'2015-01-23',NULL,'2015-01-21 11:34:41','Sergey Kotlov','2015-01-21 11:34:41','Sergey Kotlov',NULL,NULL),(23,496,213,'Já lidero times há muito tempo, e sempre me interessei por novas práticas, e vi neste curso uma grande oportunidade de aumentar o meu conhecimento e aprimorar ainda mais as minhas práticas de liderança ágil.','action items','Acredito que trabalhar mais no quadro de autorização. Achei pouco tempo para prática e discussão.','facilitator review','changes to host',9,10,'O evento foi ótimo, e o facilitador foi excelente, não vejo nada que ele possa melhorar.',1,'2015-01-21',NULL,'2015-01-21 18:05:43','Sergey Kotlov','2015-01-21 18:05:43','Sergey Kotlov',NULL,NULL),(24,16,214,'Want to learn about M3.0, location Munich not too far from my place, time slot was very good for me','action items','I think the program should be independent from Scrum or Software Development. For me this was no problem, but we had some people in the class with a different background. I think M3.0 can and should address a broader audience.','facilitator review','changes to host',9,9,'The practical part could be improved. I liked the moving motivators and the development poker. Not so much the team building game: with scrum background it was not very intersting, without scrum or software background it might be difficult to understand the roles.',1,'2015-01-23',NULL,'2015-01-23 09:13:29','Sergey Kotlov','2015-01-23 09:13:29','Sergey Kotlov',NULL,NULL),(25,16,215,'Um Einblick in agile Managementstrukturen zu erhalten','action items','ggf. das Vorwissenlevel der Teilnehmer harmonisieren','facilitator review','changes to host',9,10,'k.A.',1,'2015-01-23',NULL,'2015-01-23 09:20:47','Sergey Kotlov','2015-01-23 09:20:47','Sergey Kotlov',NULL,NULL),(26,16,217,'the reputation of Jürgen Dittmar and the community around M30','action items','better mapping to Management 1.0/2.0','facilitator review','changes to host',9,9,'i would have appreciated to see more \\\"manager\\\" as participants ',1,'2015-01-25',NULL,'2015-01-24 23:56:39','Sergey Kotlov','2015-01-24 23:56:39','Sergey Kotlov',NULL,NULL),(27,313,218,'Amelioration personnelle','action items','néant','facilitator review','changes to host',6,6,'néant',1,'2015-01-26',NULL,'2015-01-25 10:55:26','Sergey Kotlov','2015-01-25 10:55:26','Sergey Kotlov',NULL,NULL),(28,16,223,'Empfehlung von Kollegen','action items','Durchmischen der Gruppen am Beginn des zweiten Tages\r\n','facilitator review','changes to host',8,9,'...',1,'2015-01-30',NULL,'2015-01-26 09:13:45','Sergey Kotlov','2015-01-26 09:13:45','Sergey Kotlov',NULL,NULL),(29,16,224,'Consolidation of the topics learned from the book. Learn some workouts.  ','action items','none. everything was good.','facilitator review','changes to host',9,10,'swapping group members will help to learn with more diversity. ',1,'2015-01-30',NULL,'2015-01-26 09:53:59','Sergey Kotlov','2015-01-26 09:53:59','Sergey Kotlov',NULL,NULL),(30,480,225,'I was hinted by Michal Valo when trying to challenge our management on the statement \\\"We are finished with Agile implementation\\\"','action items','Nothing','facilitator review','changes to host',9,9,'Organize a transportation from/to Prague',1,'2015-02-03',NULL,'2015-01-26 20:25:20','Sergey Kotlov','2015-01-26 20:25:20','Sergey Kotlov',NULL,NULL),(31,23,226,'Interested in management techniques in an Agile environment','action items','More emphasis on techniques - how would we can use the theory covered in the course in the real world','facilitator review','changes to host',5,4,'Housekeeping (bathrooms, course agenda etc) not covered off.\r\nMore structure/ timeboxing of course activities/sessions\r\n',1,'2015-01-28',NULL,'2015-01-27 22:33:40','Sergey Kotlov','2015-01-27 22:33:40','Sergey Kotlov',NULL,NULL),(32,544,250,'Better advise managers in my company and bring them to agility','action items','Clearer instructions to start activities','facilitator review','changes to host',9,9,'May be remind more often where we are in the agenda',1,'2015-01-31',NULL,'2015-01-28 09:39:21','Sergey Kotlov','2015-01-28 09:39:21','Sergey Kotlov',NULL,NULL),(33,480,251,'Interest in agile management.','action items','No suggestions','facilitator review','changes to host',9,10,'No suggestions',1,'2015-02-03',NULL,'2015-01-28 12:17:14','Sergey Kotlov','2015-01-28 12:17:14','Sergey Kotlov',NULL,NULL),(34,413,252,'Progresser vers le management Agile. Amener au sein de mon entreprise un vue plus agile et différente du management','action items','- un support de présentation plus synthétique et qui va à l\\\'essentiel','facilitator review','changes to host',9,9,'- par des cas concrets liés à son experience et par l\\\'ajustement suite à nos retours à chaud tout au long de ces 2 jours de formations',1,'2015-01-31',NULL,'2015-01-28 14:05:54','Sergey Kotlov','2015-01-28 14:05:54','Sergey Kotlov',NULL,NULL),(35,544,253,'Comprendre les leviers du management 3.0','action items','Des cas d\\\'entreprises ayant mis en oeuvre','facilitator review','changes to host',9,10,'En activant des situations réelles de certains participants',1,'2015-01-31',NULL,'2015-01-28 16:05:16','Sergey Kotlov','2015-01-28 16:05:16','Sergey Kotlov',NULL,NULL),(36,23,238,'Recommendation from associate','action items','Less theory\r\nMore tips for motivating and inspiring teams','facilitator review','changes to host',5,4,'Less theory\r\nMore tips for motivating and inspiring teams\r\nSetting and keeping to break times so people knew',1,'2015-01-29',NULL,'2015-01-28 19:21:11','Sergey Kotlov','2015-01-28 19:21:11','Sergey Kotlov',NULL,NULL),(37,23,242,'Seeking Agile leadership training and had previously purchased the book.','action items','A lot of material for 2 days.','facilitator review','changes to host',3,4,'Need to be better at explaining concepts off slides.',1,'2015-01-29',NULL,'2015-01-28 19:39:06','Sergey Kotlov','2015-01-28 19:39:06','Sergey Kotlov',NULL,NULL),(38,23,246,'Sandy contacted me and we\\\'re at a stage that I need to know what to do next','action items','Ed, sorry but his speaking style lacks flow, its stuttered and unconfident or at least sounds it. And I had the feeling that he\\\'s more of a lecture type guy, which doesn\\\'t work when the class has more experience. Also with a class like our sometimes its better to give them a topic and let them talk it out. - That part was GREAT','facilitator review','changes to host',7,5,'Their wasn\\\'t a common thread or story through the whole thing, and it seemed disjointed at times',1,'2015-01-29',NULL,'2015-01-28 20:18:21','Sergey Kotlov','2015-01-28 20:18:21','Sergey Kotlov',NULL,NULL),(39,23,254,'As a Product Owner in an agile team I wanted to understand how to manage what my team does more effectively','action items','The content is good and the games are great but the pace was too slow for the morning of the first day - that part can be done faster so that we can get into the meat of it sooner.\r\nSome questions about why some of the older methodologies did not work, could not be answered by the facilitators. They could have come back with answers later or the next day.','facilitator review','changes to host',5,4,'Ed\\\'s delivery style is quite hesitant - it needs to flow better.\r\nKeep track of time better.',1,'2015-01-29',NULL,'2015-01-28 20:41:26','Sergey Kotlov','2015-01-28 20:41:26','Sergey Kotlov',NULL,NULL),(40,23,236,'A recommendation from a colleague','action items','For our group there was some introduction to agile material that wasn\\\'t necessary and took quite a long time. Suggest assessing the attendees and tailoring the material to suit. The most value I got from the course was doing the exercises and discussing the situations with the table. ','facilitator review','changes to host',7,6,'The way the warm up exercise was introduced was jarring and not a good beginning to an otherwise good course.',1,'2015-01-29',NULL,'2015-01-28 21:21:16','Sergey Kotlov','2015-01-28 21:21:16','Sergey Kotlov',NULL,NULL),(41,544,255,'La curiosité après avoir lu le livre Management 3.0. ','action items','Un troisième jour quelques semaines plus tard afin d\\\'offrir un retour d\\\'expérience.','facilitator review','changes to host',9,10,'Peut-être avec un meilleur fil conducteur et la possibilité de suivre le guide fourni.',1,'2015-01-31',NULL,'2015-01-28 23:00:43','Sergey Kotlov','2015-01-28 23:00:43','Sergey Kotlov',NULL,NULL),(42,23,234,'Agile Coach in Company recommended it','action items','The facilitators need to know their audience - our group had 8 people from our company and we have been implementing Agile practices in a very progressive environment for over a year. The examples of difficult \\\'management\\\', getting buy-in from the company and much more did not apply to us. Also we do not have traditional Managers in the Product team so I think we need to run the course ourselves to cut out a lot of irrelevant stories and contexts that were presented. Also on my table which was just myself from my organisation plus 3 others, the feelings we expressed in our picture - a dessert of theory, hoping for an Oasis of enlightenment at the end, which we were hopeful for but never came. The Theory, and wall of names of researchers was outdated - for example the spriral dynamics model from 1996 has totally been superseded by new evolutionary research (granted this may have just been terribly delivered as it was incomprehensible). Also there was very little links between some of the slides\\\' topics and what the point was. You do not have to have a STORY to start every section!','facilitator review','changes to host',2,0,'Learn how to listen and engage with an audience and really do your research on who you are talking to. Learn how to make a point and create it for others irrefutably.',1,'2015-01-29',NULL,'2015-01-28 23:09:30','Sergey Kotlov','2015-01-28 23:09:30','Sergey Kotlov',NULL,NULL),(43,23,243,'The GM had read the book and thought we could all gain from this','action items','Context, trainers and facilitators seemed to lack a good description of the issue/problem space that the section was desinged to solve.','facilitator review','changes to host',3,3,'More depth of context and enthusiasm',1,'2015-01-29',NULL,'2015-01-28 23:13:36','Sergey Kotlov','2015-01-28 23:13:36','Sergey Kotlov',NULL,NULL),(44,23,245,'Senior Management had decided to send a number of us to the course as part of our Professional Development','action items','There needs to be more flow between each area of discussion, rather than \\\"Here is another approach\\\". i.e. \\\"This approach was adapted to this approach when... and this spawned this method as a result of...\\\" and \\\"In this type of situation I would use method a,b, and c but not d or f\\\" ','facilitator review','changes to host',3,3,'Most of what I got out was discussion with other members in similar situations. More time allowing us to discuss our problems and offering previously successful solutions. Also the games had merit, but have more with less time to \\\'play them\\\' and more time around... this is what you should get out of this',1,'2015-01-29',NULL,'2015-01-29 18:38:16','Sergey Kotlov','2015-01-29 18:38:16','Sergey Kotlov',NULL,NULL),(45,23,244,'As a customer service manager in an agile organisation I was interested to learn more about management 3.0','action items','A little more depth, particularly on why and when to apply the concepts, I did feel at times that ideas where throw at you rather than a more cohesive approach','facilitator review','changes to host',5,5,'As above - better continuity of ideas and how/when/why to apply them.',1,'2015-01-30',NULL,'2015-01-29 23:09:53','Sergey Kotlov','2015-01-29 23:09:53','Sergey Kotlov',NULL,NULL),(46,23,228,'Suggested by a colleague','action items','More depth, less breadth, or to be a lot clearer in the description of the course on what people are getting. There seemed to be a huge number of quotes from other people, it made the content seem like just a mashup of everyone else\\\'s ideas. There seemed to be a lot of discussions where there was \\\'no right or wrong\\\', but there seemed to also be no point to the discussion, or at least it wasn\\\'t made clear enough for my slow brain.','facilitator review','changes to host',3,0,'Known their content a lot more deeply and been able to tie things back to real scenarios more understandably. Have exercises that link more closely to the content. Have stories that link more closely to the content. Ed needs to go on some presentation training in my opinion. An introduction from either facilitator would have been nice, name, background, why they are presenting this course etc.',1,'2015-01-30',NULL,'2015-01-30 01:48:42','Sergey Kotlov','2015-01-30 01:48:42','Sergey Kotlov',NULL,NULL),(47,23,261,'It was recommended to me by Sandy Mamoli.\r\nUnfortunately I could only attend the first day.','action items','It was a slow build, would suggest that the programme be more tailored to reflect the experience of the people in the room rather than forumulaic. The attendees were all senior level, all experienced with agile, and did not really hear anything new until well into the first day.\r\nSome of the english translation (from dutch?) is not quite right - spelling and context could be improved.','facilitator review','changes to host',4,5,'More interactive, facilitators who have actual experience of what they\\\'re teaching are always more interesting.\r\nTailor the course to reflect the experience in the room.\r\nMore context for the components, not just delivering to the plan.',1,'2015-01-30',NULL,'2015-01-30 02:00:25','Sergey Kotlov','2015-01-30 02:00:25','Sergey Kotlov',NULL,NULL),(48,19,219,'I wanted to increase my \\\"toolbox\\\" for managing an agile team','action items','One more day for developing many other strategy game... May be the 1 day workout is perfect for that','facilitator review','changes to host',9,10,'Give us more sweet things :-)',1,'2015-01-30',NULL,'2015-01-30 16:10:03','Sergey Kotlov','2015-01-30 16:10:03','Sergey Kotlov',NULL,NULL),(49,496,293,'Aprender um pouco mais sobre as técnicas para um bom gerenciamento.','action items','Bom, pelo conteúdo que foi passado e as dinâmicas feitas eu acho que não mudaria nada.','facilitator review','changes to host',9,10,'Gostei muito do curso e no momento, de acordo com a minha experiência, não tenho nenhuma sugestão de melhoria.',1,'2015-01-31',NULL,'2015-01-31 04:14:26','Sergey Kotlov','2015-01-31 04:14:26','Sergey Kotlov',NULL,NULL),(50,547,300,'Interessantes Thema; meinen Mann als Trainer erleben','action items','--','facilitator review','changes to host',10,10,'--',1,'2015-02-01',NULL,'2015-02-01 19:17:44','Sergey Kotlov','2015-02-01 19:17:44','Sergey Kotlov',NULL,NULL),(51,23,301,'The course was referred to me by another staff member as something that may be useful consider I\\\'d been working in Agile teams for 7 years, plus recently becoming a manager','action items','Could ','facilitator review','changes to host',2,1,'Quite a lot, Ed was not a very good presented. While Anton seemed to have more presence or experience, he still lacked substance when we asked questions - mostly we had to answer our own questions, and he would simply agree. \r\n\r\nThe facilitators did not provide very good explanations on the exercises or what problems we were trying to solve. \r\n\r\nThe first day provided too much theory and background that most people in the room already knew. The second day consisted of exercises without much reasoning or sample of how this might be used in a real workplace.\r\n\r\n\r\n problems which would be solved by the various actions and ideas suggested to us. the subject of the course .',1,'2015-02-01',NULL,'2015-02-01 20:12:41','Sergey Kotlov','2015-02-01 20:12:41','Sergey Kotlov',NULL,NULL),(52,546,302,'Up-skilling\r\n','action items','I personally really enjoyed the program, and got quite a lot out of it. I\\\'m a keen observer of people, so it was interesting to observe some people I have worked with in a learning context - although this is really irrelevant in terms of the course material.\r\n\r\nI wonder what illustrating some of the material from the facilitators own experience is supposed to achieve? I wonder if drawing out experiences from the participants would help make a more person connect to the material? It would also help shield the facilitators from criticism of their personal experience being projected onto their facilitation skill or the material itself.\r\n\r\nThere was some dispute about what constituted \\\"a fact\\\" in the Ellen exercise, so I think this one can be fine tuned. I think the point is that you can\\\'t trust \\\"a fact\\\" from a single source, and many facts are actually just projected value judgements.\r\n\r\nThe KPI exercise was interesting, as in life, most people can\\\'t tell a KPI from a contract term, a desired attribute (wish), or a rule. I personally think that KPI\\\'s are a terrible management practice and should be scrapped - especially in the context of agile practice - and wonder if a more modern practice could be explored?\r\n','facilitator review','changes to host',8,10,'I\\\'m aware that there is some criticism about some of the stories Ed shared from his experience (the age of the project mostly, I believe). I personally didn\\\'t have a problem with this - one of my favourite life changing work stories is from 20 odd years ago. I wonder if Anton can draw on some of his experience to add some gravitas when faced with a tough crowd, or if Ed has some other projects on which he can draw.',1,'2015-02-01',NULL,'2015-02-01 23:31:58','Sergey Kotlov','2015-02-01 23:31:58','Sergey Kotlov',NULL,NULL),(53,23,303,'Recommendation from Sandy Mamoli from Nomad8','action items','More training & more rigorous vetting of the instructors','facilitator review','changes to host',1,0,'- Better preparation\r\n- Improved facilitation skills\r\n- More core agile knowledge\r\n- Knowing their audience and their familiarisation with agile\r\n- Understanding the activities better',1,'2015-02-02',NULL,'2015-02-02 03:00:47','Sergey Kotlov','2015-02-02 03:00:47','Sergey Kotlov',NULL,NULL),(54,546,273,'Was recommended to me by colleagues that I trust.','action items','There is a lot about this course that needed to change.\r\n1. The game in which the class is tasked with finding facts about a character called Ellen needs to change; if the goal is to determine which methods of feedback to invest in, then the goal of the game to maximise ROI negates that goal, given that teams aren\\\'t able to explore all the methods.\r\n2. The facilitators did not know the material well enough and relied heavily on some very experienced attendees to provide insight and relevance to the course material.  We were simply reading from the slides in some cases.\r\n3. The facilitators did not elaborate for the breadth of experience present in the room, and some questions or comments were specifically ignored.  This was pretty demeaning to have to sit through.','facilitator review','changes to host',3,1,'Where to start...?  They could have made an effort to explain the concepts in more detail, related to the audience more, shown some kind of character, enthusiasm or personality during the presentations.  I didn\\\'t get the sense they were enjoying themselves, or were passionate about the content, or passionate about teaching it to people at all.',1,'2015-02-02',NULL,'2015-02-02 04:09:20','Sergey Kotlov','2015-02-02 04:09:20','Sergey Kotlov',NULL,NULL),(55,547,298,'A scrum projectin our company and the facilitator beeing part of it.','action items','./.','facilitator review','changes to host',9,9,'./.',1,'2015-02-02',NULL,'2015-02-02 07:48:54','Sergey Kotlov','2015-02-02 07:48:54','Sergey Kotlov',NULL,NULL),(56,547,296,'I’m a Project Manager (80%) which also work as  “Project management trainer” at the University (20%). Therefore I did collect over 15 years of experiments in a PowerPoint slide which transferred into a “Project Management” or “Problem Solving lecture”. This I did improve over the years and changed and modified quit a lot. Based on this state I wanted to know, how the others do and joined the course in order to look over the rim and learn.','action items','Within my course I do have a focus on “technical processes”, “change” and “teams building and development”. What I missed was ? the meaning of how do teams develop (warming, storming,…, performing..)?  What is the valley of tears (self-reflection, awareness and contribution)? what are the levels within conflict management (for instance after for example Glasl) ','facilitator review','changes to host',9,10,'I think over time they will get a better impression, how long the single sessions will and can take,  how to skip and extend the contend in the back in order to make it even smoother. ( ? But this is complaining on high level) ',1,'2015-02-02',NULL,'2015-02-02 08:04:35','Sergey Kotlov','2015-02-02 08:04:35','Sergey Kotlov',NULL,NULL),(57,547,297,'Working in an agile project','action items','nothing','facilitator review','changes to host',9,10,'everything was really good, just a little bit more praxis',1,'2015-02-02',NULL,'2015-02-02 08:55:38','Sergey Kotlov','2015-02-02 08:55:38','Sergey Kotlov',NULL,NULL),(58,544,304,'Je me suis inscrit à cette formation suite à plusieurs échanges avec Laurent Sarrazin sur l\\\'intérêt des concepts de l\\\'agilité pour accompagner mes clients en coaching ou en Team Building','action items','Une journée supplémentaire (pour une durée totale de 3 jours) serait un plus pour approfondir certains thèmes de cette formation et faire plus d\\\'ateliers','facilitator review','changes to host',8,9,'Plus d\\\'équilibre (en durée) entre les différents thèmes',1,'2015-02-02',NULL,'2015-02-02 08:59:56','Sergey Kotlov','2015-02-02 08:59:56','Sergey Kotlov',NULL,NULL),(59,547,294,'To get Informations about new Management Approaches','action items','nothing; everything was fine','facilitator review','changes to host',9,9,'No Idea; for my feeling the event was done very well',1,'2015-02-02',NULL,'2015-02-02 09:10:20','Sergey Kotlov','2015-02-02 09:10:20','Sergey Kotlov',NULL,NULL),(60,19,267,'I am looking for an agile approach in term of management for non-IT industries','action items','Add 1 day workout for full practice of major concepts. To be done 2 or 3 weeks after this training','facilitator review','changes to host',9,9,'It was perfect',1,'2015-02-02',NULL,'2015-02-02 14:41:27','Sergey Kotlov','2015-02-02 14:41:27','Sergey Kotlov',NULL,NULL),(61,476,305,'Invitation by a colleague','action items','-','facilitator review','changes to host',9,10,'-',1,'2015-02-04',NULL,'2015-02-02 15:45:48','Sergey Kotlov','2015-02-02 15:45:48','Sergey Kotlov',NULL,NULL),(62,469,306,'know the best practices for managing a team working in agile process\r\nhave the culture and the spirit associated','action items','practical exercises are better than theory','facilitator review','changes to host',9,9,'RAS',1,'2015-02-03',NULL,'2015-02-02 16:49:30','Sergey Kotlov','2015-02-02 16:49:30','Sergey Kotlov',NULL,NULL),(63,547,295,'Recommendation from Marco','action items','Was just right, no further recommendations','facilitator review','changes to host',10,10,'Exactly tailored to my needs, no suggestions for improvement',1,'2015-02-02',NULL,'2015-02-02 16:56:16','Sergey Kotlov','2015-02-02 16:56:16','Sergey Kotlov',NULL,NULL),(64,544,307,'The advise of a Agile Coach helping us in my company + my curiosity','action items','More informations about change management and auto-organisation (How to...)','facilitator review','changes to host',8,8,'A \\\"cadenceur\\\" (coming from participants) to help the teacher to follow the program (because the program is soo interesting that we keep asking more questions...)',1,'2015-02-03',NULL,'2015-02-02 18:44:57','Sergey Kotlov','2015-02-02 18:44:57','Sergey Kotlov',NULL,NULL),(65,26,308,'I read the books of Jurgen Appelo (man3.0 and #workout). The covered topic was useful for me. And I have decided to be licensed man3.0 facilitator, so I looked for a training in Berlin, so I joined this event','action items','Program and content is OK','facilitator review','changes to host',3,0,'Choosing better event location;\r\nWorking on teaching skills;\r\nWorking on facilitation skills;\r\nWorking on clear and precise communication;\r\nEnhancing english;\r\nClearly explaining the reasoning behind the topics;\r\nFocusing more on what is happening and being with participants instead of trying to make advertisement by working with photographer to stage something\r\nFacilitator should not delegate everything to students\r\nFacilitator has to create a link between himself and students.',1,'2015-02-03',NULL,'2015-02-02 20:00:52','Sergey Kotlov','2015-02-02 20:00:52','Sergey Kotlov',NULL,NULL),(66,546,277,'Jurgen\\\'s presentation at Agile Auckland in 2014 plus a recent promotion which involves taking over management of my organisation\\\'s development team.','action items','I think the program is fine - the way it was delivered could be improved. ','facilitator review','changes to host',4,5,'- Better knowledge of course content.\r\n- Better understanding of how principles and processes can be applied in practice.\r\n- Better examples of Mgmt3.0 vs Mgmt1.0 type situations that specifically relate to software development organisations.\r\n- More applied experience that would better equip them to answer or respond to questions.',1,'2015-02-02',NULL,'2015-02-02 20:52:50','Sergey Kotlov','2015-02-02 20:52:50','Sergey Kotlov',NULL,NULL),(67,19,309,'mon poste de manageur dans un contexte agile','action items','-les supports papier ne sont un peu confus: on a un peu de mal à s\\\'y retrouver car il y a peu de liaisons entre elles.\r\n-Un support electronique serait le bienvenue','facilitator review','changes to host',9,10,'l\\\'intervalle entre les exercices devrait etre plus court.',1,'2015-02-03',NULL,'2015-02-03 13:16:22','Sergey Kotlov','2015-02-03 13:16:22','Sergey Kotlov',NULL,NULL),(68,19,310,'mon poste de manageur dans un contexte agile','action items','-les supports papier ne sont un peu confus: on a un peu de mal à s\\\'y retrouver car il y a peu de liaisons entre elles.\r\n-Un support electronique serait le bienvenue','facilitator review','changes to host',9,10,'l\\\'intervalle entre les exercices devrait etre plus court.',0,NULL,NULL,'2015-02-03 13:17:06','Sergey Kotlov','2015-02-03 13:17:06','Sergey Kotlov',NULL,NULL),(69,19,311,'L\\\'envie de m\\\'amé