 Workout session with Jurgen. A path to get certified as a facilitator.','action items','Facilitators need to show the connection between learning objectives - content in the slides and the activities. Most people were lost most of the the time. Common questions was \\\"why are we doing this?\\\" and \\\"where are we?\\\"','facilitator review','changes to host',1,0,'Go away and study the material and related content until they understand it with some depth. Explain the learning objectives and check the learning objectives have been met. Get their facts right. Adjust to the level in the class.',1,'2015-02-08',NULL,'2015-02-07 22:46:26','Sergey Kotlov','2015-02-07 22:46:26','Sergey Kotlov',NULL,NULL),(85,486,330,'I was referred to this programme by a colleague from headquarters','action items','Some more practical scenarios and examples of how things worked and did not work would make it easy to relate to actual work scenarios','facilitator review','changes to host',6,6,'Setting the course objective at the start of the program could bring some more structure',1,'2015-02-16',NULL,'2015-02-08 16:52:33','Teller API','2015-02-08 16:52:33','Teller API',NULL,NULL),(86,29,326,'good price','action items','more examples from actual implementations','facilitator review','changes to host',4,6,'more structured presentation',1,'2015-02-09',NULL,'2015-02-08 17:59:55','Teller API','2015-02-08 17:59:55','Teller API',NULL,NULL),(87,464,331,'Le contenu permettant de voir le management  autrement','action items','Les interactions  avec d autre personne  avec leur propre expérience c est à conserver.  Les slides peuvent être allégés','facilitator review','changes to host',10,8,'Optimiser quand le sujet ou les retour d expérience était trop long',1,'2015-02-10',NULL,'2015-02-08 19:49:19','Teller API','2015-02-08 19:49:19','Teller API',NULL,NULL),(88,546,332,'A colleague had attended a Management 3.0 workout course and thought this course would be beneficial.','action items','More and better real-world examples of virtually everything mentioned. Better instructions and explanations for the exercises - often had no idea what we were supposed to do (or why we were doing it). The recap after each section was not a recap - it often introduced new ideas from the group because the post-its were not that related to what we\\\'d covered. Way too many slides - lots of meaningless words but most not explained properly.','facilitator review','changes to host',0,0,'I was going to say, get more familiar with the material but apparently they been giving this course for years. Perhaps they haven\\\'t given it for a while and were a bit under-prepared but it\\\'s hard to imagine it was ever at an acceptable level given what we were subjected to.\r\n\r\nHonestly, the best things they could have done was admit defeat and get some of the class to run it - it would have been an improvement.',1,'2015-02-09',NULL,'2015-02-08 20:45:22','Teller API','2015-02-08 20:45:22','Teller API',NULL,NULL),(89,29,333,'Personal invite. Good price. Latent interest.','action items','More experiental practice, follow up (OTJT) and less focus on models and intellectual knowledge. Are people really using the knowledge when they get back to work?','facilitator review','changes to host',6,6,'More experiental practice, follow up (OTJT) and less focus on models and intellectual knowledge. Reduce the mass of content, possibly spread out in time. This stuff takes lots of time to grasp and integrate. Risk that it is over the particiapants heads due to the amount of information.',1,'2015-02-09',NULL,'2015-02-09 09:30:46','Teller API','2015-02-09 09:30:46','Teller API',NULL,NULL),(90,26,336,'Use of Agile in our development teams and understanding of my role as lead quality asssurance','action items','More practical uses of agile management rather than theory','facilitator review','changes to host',3,5,'More real practical uses of it, understanding of how agile can be used with roles esp management roles such as QA and release management which I do not believe has been truly developed, it is only a development process along with TDD.',1,'2015-02-10',NULL,'2015-02-10 06:35:30','Teller API','2015-02-10 06:35:30','Teller API',NULL,NULL),(91,29,327,'A great interest in agile and how we can adopt the agile mindset and values to other parts of the organization but production / software dev.','action items','Not too deep into complexity theory at this stage. It is complex for persons who are not familiar with the concept, and demands quite deep understanding of agile. ','facilitator review','changes to host',9,9,'Sometimes could work a little more on \\\"the red thread\\\" (a very Swedish expression ;)) but all in all it was great! :) ',0,NULL,NULL,'2015-02-10 14:02:03','Teller API','2015-02-10 14:02:03','Teller API',NULL,NULL),(92,16,337,'I attended one of the first book presentations of Jurgen in 2011. Since then I had the plan to visit a Management 3.0 - Training - and now has been the right time ;-)','action items','Less slides and talking from front of the room, more exercises and training from the back of the room.Also it would have been for me of higher interest to get practical advice how to convince Managers to use Management 3.0, generell Changemanagement-Topics etc. For me it looked like the coursing being what you learn normally in the first 2-3 Hours of a ScrumMaster-Course - just extended to two days.','facilitator review','changes to host',7,2,'Doing more training from the back of the room and having both excercises and war-stories for beginners and advanced people like me.',1,'2015-02-13',NULL,'2015-02-10 16:08:54','Teller API','2015-02-10 16:08:54','Teller API',NULL,NULL),(93,29,325,'The excitement to learn more about management 3.0.','action items','I do not think anything is missing in the course. The participants processed the contents of the course, which was great.  ','facilitator review','changes to host',10,10,'Nothing during this occasion. ',0,