h war so sehr zufrieden.','facilitator review','changes to host',10,9,'Die Agenda bzw die vorgeschlagenen Übungen evtl schon zu Beginn zur Diskussion stellen.',1,'2015-05-20','k7BaAt5eAleW4vDZnsZPi02zpENLmuG6d2cJ7Y5xuPV4V2H9gOjLDlBHEh5MST1a','2015-05-20 12:14:18','Management 3.0','2015-05-20 12:14:18','Management 3.0',NULL,NULL),(456,54,744,'We use already several tools of Management 3.0 beacuse it fits very good to our company´s mindset. By now only one of my colleagues went to the 2 days training. Many of us read the book, and decided to join the \"movement\". So it was about time for more than one of us to learn more about the potential of M 3.0 and gain more knowledge. We want to keep going this way. And as I´m one of the people in our company, who ist highly interested in driving the change, I decided to attend the training.','action items','To me the training was really good. There was enough space for questions and Jürgen and all the other attendees had enough time to talk about their personal experiences. ','facilitator review','changes to host',10,10,'Jürgen, respectively, the training met my expectations. I have nothing to complain about. ',1,'2015-05-20','BObGYW8jPZHT10V2mqVwydQ04NKsDEU5RLwLxeLFbQTPCGe6etnay6Yio1AEj9D3','2015-05-20 14:08:30','Management 3.0','2015-05-20 14:08:30','Management 3.0',NULL,NULL),(457,516,745,'I attendes the 2 days training, but as I am rather a hands-on-person, the workout was the perfect complement. ','action items','One attendee mentioned, that we should have decided at the beginning of the workout at which tools we would like to look closer or to try out. I had the impression that we were running out of time, and after the break Jürgen decided to focus on the tools that are most interesting to us. Right decision. ','facilitator review','changes to host',8,9,'It was Jürgens first workout.  I think with the following workouts he will improve or optimize time management, fitting to the attendees needs. He aksed for feedback and noticed our suggestions. ',1,'2015-05-20','4BswxkQdIiNfvTAy3FxdHWfprZbuwLBBK6tD4lOaUVvkxeragjZt215WG0I2H9Zs','2015-05-20 15:55:16','Management 3.0','2015-05-20 15:55:16','Management 3.0',NULL,NULL),(458,641,746,'La necesidad de ayudar a cambiar mi organización','action items','Para mi el programa está bien','facilitator review','changes to host',10,10,'Mas historias que generen mayor conexión',1,'2015-05-20','1QFqtOdxIscFJIktBPFgAaqnKnLdChW65tc5HVtJc9cG6G98MPwcwKlBzJXpwzVx','2015-05-20 18:56:12','Management 3.0','2015-05-20 18:56:12','Management 3.0',NULL,NULL),(459,642,747,'Continuar con los ejercicios del Management 3.0','action items','Mas tiempo para las dinámicas','facilitator review','changes to host',10,10,'No pasar tan rápido por algunos de los temas',1,'2015-06-02','fS2j8Pf2PsRVP4XUBvN0ozVtJOyjOotbpHqoXWEL561CHGzcuPCJ3H0m5x7ifF8U','2015-05-20 19:03:42','Management 3.0','2015-05-20 19:03:42','Management 3.0',NULL,NULL),(460,612,751,'Read Management 3.0 book and wanted to get deeper understanding','action items','I would suggest to reduce discussions between topics, it felt that participants spent too much time to discuss their opinions on the topic instead of letting facilitator to present the material','facilitator review','changes to host',8,9,'Cut short discussions between attendies (Telus people were dominating with their specific use cases and it seems that they are very new to Agile world)',1,'2015-05-21','kOPOf7RO9ebpg54vgKjSXfYnxoCcznoQUHYAe3P1x6Q9kI2qqJadEcLCfj7X5JFh','2015-05-21 02:16:51','Management 3.0','2015-05-21 02:16:51','Management 3.0',NULL,NULL),(461,612,752,'Want to learn about the program as I am part of a group that includes Management 3.0 in our training offers. Would like to be another facilitator of the program. ','action items','Worked fine for me. I got what I was expecting.','facilitator review','changes to host',10,10,'Not sure. Based on their questions, I think some people pretended that they knew more about agile than they re