rk collegues that had attended and gave it their highest recommandations. ','action items','Nothing besides extending the course to a 3 day event, perhaps? I really feelt that on the second day I had started to change perspective from many standard point-of-views of more traditional management/organizational thinking. ','facilitator review','changes to host',10,10,'Overall I was very pleased with the arrangement. But I think some more micro pauses would actually help the learning process and trigger more conversations which wuold enrich the experience. It´s proven that activating more that one area of the human organism (both mind and body) helps out in the learning process.  This gives me more argument for making the course a 3 day event. ',1,'2015-06-16','8oEnnAb1lOM74BjUNdCIxH4opUIBXwV4TJKvJcycPLnxdqWEwvRynJialSNItE8z','2015-06-16 07:07:42','Management 3.0','2015-06-16 07:07:42','Management 3.0',NULL,NULL),(614,707,983,'The need to find new ways to manage agile teams.','action items','it\'s o.k.','facilitator review','changes to host',9,10,'it´s o.k.',1,'2015-06-18','xemU2XL8qxrTkKvkuZJXjuX9XfuqM3HJlSR71zRFzQA4nBPReRr5lR3sTdkleL5k','2015-06-16 12:56:50','Management 3.0','2015-06-16 12:56:50','Management 3.0',NULL,NULL),(615,704,984,'Una visión diferente de ayudar a mi equipo al crecimiento personal y profesional','action items','Creo que es necesario dar unos objetivos concretos al iniciar el curso. Que las personas sepan que lograrán y que no lograrán en el curso.\r\nPor otro lado, es sumamente necesario un orden más lógico a las diapositivas para evitar que nos perdamos en el tema.','facilitator review','changes to host',9,10,'Proponer más espacios de participación, no sólo decir: ¿Alguien más tiene una historia?',1,'2015-06-18','qUa7hdN3K6Ves7kiFOnpmPNVY6WxZYc376qqlR6f6QvWc2lZjXwSZ30PdCIoaZqV','2015-06-16 13:32:08','Management 3.0','2015-06-16 13:32:08','Management 3.0',NULL,NULL),(616,584,985,'Interesse pelo tema. Trabalho com gestão no Serpro.','action items