un juego o dinámica o resolución de un probrema utilizando la técnica en particular(donde el juego, la dinámica o el problema estén pre-definidos(as) por el facilitador) esto con el fin de tener diversidad de actividades para el mismo ejercicio buscando que todos interioricemos el mismo concepto desde diferentes prácticas y es más enriquecedor. Así mismo ejercicios tan sencillos como el de los primeros minutos del primer día del curso, donde buscamos hacer un triangulo de 2 lados iguales, o de 3 lados iguales eligiendo las personas o protegiendo al tigre del dragon para explicar problemas simples, semi-complejos, muy complejos y caoticos son muy sencillos y buenos para interiorizar conceptos, así que se deben hacer más de este tipo de dinámicas sencillas y llenas de contenido para algunos conceptos (si existen claro está)',1,'2015-07-16','G5itwsYhgMjS78VldJ7ctwY3lIoAIDV4CbBndW1wYedTArXY7kNLedYnpNj5MUhb','2015-06-24 04:03:56','Management 3.0','2015-06-24 04:03:56','Management 3.0',NULL,NULL),(666,705,1048,'Interes de conocer nuevas técnicas de Gerenciar potencializando los equipos de trabajo\r\n','action items','Dado que la unidad de Gestión del cambio es la más importante yo la movería para  la primera hora de la mañana del segundo día (en la mañana es mejor recibir conocimiento complejo de aplicar), y el contenido de la mañana del segundo día que es más digerible, es más vivido por todos y son pildoras alcanzables de aplicar lo dicto para después del almuerzo y nos mantendrá despiertos, además porque es más vendible, dado que para poder montar todo lo que se vió el primer día, se requiere aplicar algunos tips de los 20 que se ven en gestión del cambio.','facilitator review','changes to host',10,10,'Garantizar que las actividades estén más repartidas en distintos formatos, por ejemplo: una actividad que todos hicimos en cartelera, buscar que solo 2 equipos utilicen la cartelera, otros 2 equipos obra de teatro, y los otros 2 un juego o dinámica o resolución de un probrema utilizando la técnica en particular(donde el juego, la dinámica o el problema estén pre-definidos(as) por el facilitador) esto con el fin de tener diversidad de actividades para el mismo ejercicio buscando que todos interioricemos el mismo concepto desde diferentes prácticas y es más enriquecedor. Así mismo ejercicios tan sencillos como el de los primeros minutos del primer día del curso, donde buscamos hacer un triangulo de 2 lados iguales, o de 3 lados iguales eligiendo las personas o protegiendo al tigre del dragon para explicar problemas simples, semi-complejos, muy complejos y caoticos son muy sencillos y buenos para interiorizar conceptos, así que se deben hacer más de este tipo de dinámicas sencillas y llenas de contenido para algunos conceptos (si existen claro está).',1,'2015-07-16','gIZltmuIDo1Jl5V2D7aqRaMEyjRIj3eyxi7YRLf6EqfCR0OJJVMeqfj6FZUtMoGG','2015-06-24 04:11:21','Management 3.0','2015-06-24 04:11:21','Management 3.0',NULL,NULL),(667,668,1049,'Deep-dive into Management 3.0 practices.','action items','\"Developing\" a team should be added: How come new members to a Team, what are the best practices if someone within a team does not integrate, what should be done if someone leaves the team... ','facilitator review','changes to host',9,9,'Well, that\'s not easy because the workshop was very good - but perhaps Jurgen could have joined the individual discussion groups / each table once (and only for a limited time) to deep dive into specific topics - or just to exchange some of his experience to a specific practice/discussion. ',0,NULL,'UF0BBjDEqhZytMFDKeftFw4mBuGgo51EDvlvPeqG1ZaN3So9Q8UZhA1hjLswcByb','2015-06-24 05:36:58','Management 3.0','2015-06-24 05:36:58','Management 3.0',NULL,NULL),(668,595,1050,'Vi utvecklar företagets processer för TM','action items','-','facilitator review','changes to host',9,10,'Känns stabilt.',1,'2015-06-25','GNBNrJ7Ngzh1Spuk67PY15sYgeYfqteYnge8Z9fhbHEIijfoG6ap1eRRNiVZAUzB','2015-06-24 06:49:54','Management 3.0','2015-0