l approach I would suggest a bigger variety of appliance in our exercises. Eg. we should execute exercises not only common to IT specialization as this is not the only area where you may apply these methodologies and techniques.','facilitator review','changes to host',8,8,'Improved teaching pace and more control upon lessons timeframes.',1,'2015-09-26','8MRsYVcD834ZjLPOpGG2bUmv8ABH8YI1FYpmnDCU7mfoS91EhxP5QWTmBI92TBot','2015-09-23 07:51:15','Management 3.0','2015-09-23 07:51:15','Management 3.0',NULL,NULL),(971,816,1544,'Nyfikenhet och behov av att skapa en gemensam bild.','action items','Det hade varit bra att inleda med att skapa en gemensam bild av vad den största förändringen för oss innebär. Jag tror att det finns olika uppfattningar.','facilitator review','changes to host',8,7,'Hellre fördjupa sig och praktisera ett antal modeller än att dra igenom dem för snabbt. Risk att man inte tar till sig och förstår hur det kan tillämpas.',1,'2015-09-28','03KYhHEtaBpiHZs4GVRwyK8iMMZBmA4Eod7X31USrHBxVPegoC3oWhCVSPMUzNU1','2015-09-23 08:26:23','Management 3.0','2015-09-23 08:26:23','Management 3.0',NULL,NULL),(972,816,1545,'Inhouse training.','action items','-','facilitator review','changes to host',9,8,'-',1,'2015-09-28','Hlgz290peiv68fgDei1DqvRMsjcN4BwIj8BE8syp0i1z7oUQzFT8MpJ45FahIEg7','2015-09-23 10:45:20','Management 3.0','2015-09-23 10:45:20','Management 3.0',NULL,NULL),(973,816,1547,'Bygga på tankemönster och beteenden med bra verktyg för att leda i en förändring som ger möjlighet till ökad möjlighet att uppnå möjligheterna med agila arbetsformer.','action items','Möjligen mer om hur att mäta förändring','facilitator review','changes to host',9,10,'Ej möjligt på den tid vi efterfrågat eventet.',1,'2015-09-28','IQqTGwlr68mLBiNWW1wwsFcinxLaNqIgcqHWCNX9dV4Omg7JpDD9PMFab66pxUDM','2015-09-23 14:55:55','Management 3.0','2015-09-23 14:55:55','Management 3.0',NULL,NULL),(974,62,1548,'i\'ve known management 3.0 for some time and loved it ever since. Our organisation is in dee