p of my organization,  and the fact that this event wasn\'t available in The Netherlands.','action items','Make it a 3-day course, and invest more time per topic.','facilitator review','changes to host',8,10,'Time constraints per topic were not visible for the participants. Therefore we couldn\'t take ownership for this, and as a result, I was sometimes reluctant to ask questions or share opinions because I didn\'t know if we had enough time for the following topics . And I noticed sometimes we had to rush through a topic, meaning that we didn\'t properly manage the time we had available.\r\n\r\nPersonally I\'d prefer more duo presenting/facilitating. I tend to loose my attention when I listen to one person for a long time. \r\nSince there were 2 facilitators present, it would have been possible to switch turns more often, and I like more interaction with both presenters at the same time.',1,'2015-09-25','hx0y8twIAFxDtav0VLst47D1cL3ZYsQ50714Rqyea11tpw6FYBDPeauzNhHCsuyN','2015-09-25 06:49:56','Management 3.0','2015-09-25 06:49:56','Management 3.0',NULL,NULL),(978,45,1558,'I want to develop my team to be a High Perfomance Team.','action items','More of feedback, should have had a specific exercise with feedback.','facilitator review','changes to host',9,10,'Nothing, but I should do this workshop with my team.',1,'2015-09-25','Dw9eva1Trx532S6qzqxTfqn53fpgYPgRxQmVhbQ7M4AHz4ntkKsZVlEGbfdcsyau','2015-09-25 06:59:54','Management 3.0','2015-09-25 06:59:54','Management 3.0',NULL,NULL),(979,45,1555,'I´m eager to learn more about management 3.0 and have worked with Pia-Maria before.','action items','Maybe bigger groups so the groups could do some of the challenges separately and then discuss them','facilitator review','changes to host',9,9,'I think Pia-Maria did a great job.',1,'2015-09-25','7bZyvkh3j7n5KJvg0CFtZdkXLb33sQFKbXTV5aTPMa4Lz0ynSM6LPilF0N4pk8RJ','2015-09-25 07:07:47','Management 3.0','2015-09-25 07:07:47','Management 3.0',NULL,NULL),(980,622,1559,'J\'avais vu une pr