r?\nAll executives, functional managers, management consultants, team leads, project managers, agile coaches and scrum masters who want to add more effective management practices to their leadership repertoire. No practical experience with Agile is necessary, although minimum familiarity with Agile principles and practices is helpful.\n\nThis training is developed by Jurgen Appelo is an Agile coach, speaker, writer, trainer and leader. He writes a popular blog (www.noop.nl) that covers many interesting topics including: Agile Management, software engineering, business improvement, personal development, and complexity theory. We use original course materials developed by Jurgen Appelo and apply 40 years of combined experience of implementing successful Agile transformation and coaching corporate leaders all over the world. All course participants will receive materials of the course exercises and an official Management 3.0 certificate upon completing the course. You also get 16 PDUs toward PMP recertification and 16 PDUs toward PMI-ACP certification.\n\n\nWhat You’ll Learn?\nEnergize People: Learn what truly motivates people, the carrot/stick method of mechanistic organizations is long gone!\nEmpower Teams: Teams crave 3 things to make them hyper-productive.  Learn what they are and how to foster great teams.\nAlign Constraints: Self-organization doesn’t mean chaos! Learn how to use situational leadership to put the right constraints in place.\nDevelop Competence:  People love learning, learn how to foster a craftsmanship attitude.\nGrow Structure: Software and project teams are often handcuffed by organizational constraints, learn how to create the right environment for success.\nImprove Everything: Learn what Lean Change is and how to use it to improve anything.\n\n\n\nWhat Happens Next?\n\nMost of the 2-day M3.0 course attendees and in-house training participants report immediate improvements. In addition, after the course, we continue to keep in touch with our attendees and provide guidance and support over email and Skype.','',0,'2014-10-06','2014-10-07',8,16,'http://www.m-3-0.com/m3.0-training.html','http://m30moscow.eventbrite.com',0,0,1,0,0,0.00),(407,1,1,'Management 3.0 two day course','PT',NULL,'EN','Rio de Janeiro','BR','','',0,'2014-08-25','2014-08-26',8,16,'http://www.adaptworks.com.br/TreinamentoDetalhes/management-30/','http://www.adaptworks.com.br/TurmaDetalhes/management-30/1165/',0,0,1,0,0,0.00),(408,1,1,'Management 3.0 two day course','PT',NULL,'EN','Rio de Janeiro','BR','','',0,'2014-06-09','2014-06-10',8,16,NULL,NULL,0,0,1,0,0,0.00),(409,1,1,'Management 3.0 two day course','PT',NULL,'EN','Rio de Janeiro','BR','','',0,'2014-04-14','2014-04-15',8,16,NULL,NULL,0,0,1,0,0,0.00),(410,1,1,'Management 3.0 - Leadership Seminar (2 Tage)','DE',NULL,'EN','Vienna','AT','','',0,'2013-12-04','2013-12-05',8,16,'http://agileexperts.at','http://agileexperts.at',0,0,1,0,0,0.00),(411,1,1,'Management 3.0 - Agile Leadership Course (2 days)','EN',NULL,'EN','Budapest','HU','Agile Leadership Practices for innovative leaders, and all change agents. This is an official management 3.0 training with a very unique focus on hands-on materials, exercises and games. Participants gain deeper insights on how to approach Agile in organizations (whether in IT or any other industry), how to approach effective change and how to get the shift towards the new role of an Agile leader. You will learn approaches and tools, which can be directly applied in your own business the next days.','This course is organized by our partner Sprint Consulting.',0,'2014-12-04','2014-12-05',8,16,'http://www.sprintconsulting.com/workshops/management-3-0/','http://www.sprintconsulting.com/workshops/management-3-0/',0,0,1,0,0,0.00),(412,1,1,'Management 3.0 - 2jrs - ARCUEIL','FR',NULL,'EN','ARCUEIL','FR','','',0,'2014-11-06','2014-11-07',8,16,'www.zenika.com','http://www.zenika.com/formation-manager-agile.html',0,0,1,0,0,0.00),(413,1,1,'Management 3.0  - 2 jours / LYON