 o similares aproximaciones, aunque será útil estar familiarizado con los principios y prácticas ágiles. El objetivo del curso no es aprender metodologías Ágiles de desarrollo sino comprender mejor cómo tratar con equipos auto-organizados, cómo motivar a las personas, cómo abordar la complejidad de la organización, cómo definir estructuras organizativas Ágiles…\r\n\r\nEl curso normalmente atrae a jefes de equipo (15%), gerentes de desarrollo (15%), coaches ágiles (15%), scrum masters (15%), gerentes de proyecto (10%), product owners (10%), desarrolladores y testers (10%), y gerentes de alto nivel (10%). La valoración media de todos los cursos de Management 3.0 impartidos por todo el mundo es superior al 8.4.\r\n',37,'2015-04-20','2015-04-21',8,16,'http://www.proyectalis.com/2015/02/13/management-3-0-madrid-2015/','http://www.proyectalis.com/2015/02/13/management-3-0-madrid-2015/',0,0,1,0,0,8.21),(572,1,1,'Regular 2-Day Management 3.0 Course','EN',NULL,'EN','Athens','GR','This is a regular Management 3.0 course, ','More details coming soon',0,'2015-09-16','2015-09-17',8,16,'http://www.cocondi.de/index.php/management-30','http://www.cocondi.de/index.php/management-30',0,0,1,0,0,9.00),(574,1,1,'Agile Business Management (Management 3.0)','EN',NULL,'EN','Prague','CZ',NULL,NULL,0,'2015-07-23','2015-07-24',8,16,'https://www.eventbrite.com/e/agile-leadership-training-in-prague-management-30-tickets-15779198006','https://www.eventbrite.com/e/agile-leadership-training-in-prague-management-30-tickets-15779198006',0,0,1,0,0,6.00),(575,1,1,'Regular 2-Day Management 3.0 Course','EN',NULL,'EN','Lincolnshire (Chicago Area)','US','This 2-day workshop is happening before ALM Chicago.',NULL,0,'2015-05-11','2015-05-12',8,16,'https://www.eventbrite.com/e/management-30-workshop-tickets-15745211351','https://www.eventbrite.com/e/management-30-workshop-tickets-15745211351',0,0,1,0,0,8.00),(577,2,1,'Exclusive 1-Day #Workout Workshop','EN',NULL,'EN','Cluj-Napoca','RO',NULL,NULL,0,'2015-02-1