 apply better, innovative practices to managing change.',NULL,0,'2015-06-02','2015-06-03',8,16,'http://leanchange.org/events/event/2-day-lean-change-agent-berlin/','http://www.eventbrite.de/e/berlin-meets-jason-little-the-lean-change-agent-workshop-tickets-15756570326',0,0,1,0,0,0.00),(610,1,1,'Regular 2-Day Management 3.0 Course','DE','DE','DE','Berlin','DE','Das Seminar ist in deutscher Sprache. Es basiert auf dem Buch \"Management 3.0\" von Jurgen Appelo und richtet sich neben Führungskräften und Managern an alle Menschen, die in und mit agilen und komplexen Organisationen arbeiten möchten.',NULL,0,'2015-05-06','2015-05-07',8,8,'http://www.ausculto.de/management-3-0-seminare.html','https://www.eventbrite.com/e/management-30-two-day-course-in-berlin-deutsch-tickets-16121341366',0,0,1,0,0,9.00),(612,1,1,'Regular 2-Day Management 3.0 Course','EN',NULL,'EN','Toronto','CA',NULL,NULL,0,'2015-05-18','2015-05-19',8,16,'http://leanintuit.com/events/event/management-3-0-toronto/','http://m30-toronto.doattend.com/',0,0,1,0,0,7.86),(614,1,1,'Intra Management 3.0 VSCT - Mars 2015','FR',NULL,'EN','Paris','FR','Stage \"Management 3.0\" intra-entreprise VSCT\r\n\r\nLe \"Management 3.0\" parle du rôle et des outils du manager dans un contexte agile où les équipes sont sensées être \"auto-organisées\". Nous allons travailler, souvent en petits groupes, et à partir de votre vécu de manager (et du mien), autour de 8 thématiques : \r\nL\'agilité et la place du manager\r\nAgir en complexité \r\nLa mobilisation des personnes\r\nL\'autonomie des équipes\r\nL\'alignement des contraintes\r\nLe développement des compétences\r\nL\'évolution de l\'organisation\r\nLa conduite du changement\r\n','En préparation, je vous invite à réfléchir à deux questions. \r\n\r\nPrenez le temps d\'y penser, même si ça n\'est que 5 à 10 minutes, pendant votre pause, dans les transports ou ce week-end. Nous utiliserons vos réponses mardi matin. \r\n\r\nLa première question est : \"Quelles sont les difficultés (de management, que je rencontre aujourd\'hui), ou les questions, que soulèvent pour moi ces thèmes ?\". \r\nJe vous invite à répondre à cette question par une série de Post\'it formulés comme des questions (un post\'it par question ou difficulté), que nous partagerons et associerons aux thèmes. Vous n\'avez pas besoin d\'avoir une question pour tous les thèmes et vous pouvez en avoir plusieurs sur le même thème. En revanche, si une de vos questions porte sur plusieurs thèmes en même temps, je vous invite à la dédoubler et à la reformuler sous l\'angle de chacun des thèmes concernés. \r\n\r\nLa deuxième question est \"Quelle est mon intention en venant à ce stage ?\". Vous pouvez garder votre réponse à cette question pour vous, mais je vous invite à vous la formuler précisément, et donc à l\'écrire quelque part. Elle peut découler des réponses à la question précédente ou être sans rapport, mais c\'est important que vous explicitiez pour vous-même ce que vous venez chercher, ce que vous espérez que ces trois jours vont débloquer ou impulser. Mon but est que vous ayez une intention car cela augmente considérablement l\'impact de la formation.\r\n\r\nVous n\'aurez pas besoin d\'ordinateur. En revanche venez avec de quoi écrire ou dessiner. ',101,'2015-03-16','2015-03-18',7,21,'http://www.coactiv.fr','mailto:d.thouvenin@clt-services.com',1,1,1,0,0,8.67),(615,1,1,'Management 3.0 - Agile Leadership für Adaptive Organisationen (2 Tage)','DE',NULL,'EN','Vienna','AT','Agile Führungspraktiken und die Leadership-Agenda für Führungskräfte mit Weitblick. Ihre persönliche Leadership-Agenda für die agile Organisation.',NULL,0,'2015-06-22','2015-06-23',8,16,'http://agileexperts.at','http://m30-vienna-0615.eventbrite.de',0,0,1,0,0,0.00),(617,1,1,'2 jours GRENOBLE avec Alex BOUTIN','FR','FR','FR','GRENOBLE','FR',NULL,NULL,0,'2015-03-12','2015-03-13',8,16,'http://www.rupture21.com',NULL,0,0,1,0,0,8.67),(618,1,1,'2jrs - PARIS','FR','FR','FR','PARIS','FR',NULL,NULL,0,'2015-03-19','2015-