finir estructuras organizativas Ágiles…\r\n\r\nEl curso normalmente atrae a jefes de equipo (15%), gerentes de desarrollo (15%), coaches ágiles (15%), scrum masters (15%), gerentes de proyecto (10%), product owners (10%), desarrolladores y testers (10%), y gerentes de alto nivel (10%). La valoración media de todos los cursos de Management 3.0 impartidos por todo el mundo es superior al 8.4.',0,'2015-04-16','2015-04-17',8,16,'http://www.proyectalis.com','http://www.atana.org/es/index.php?option=com_seminar&task=3&cid=120',0,1,1,0,0,9.12),(625,1,1,'Regular 2-Day Management 3.0 Course - Inhouse swissLife','DE',NULL,'DE','Zurich','CH',NULL,NULL,0,'2015-03-24','2015-03-25',8,16,'http://pragmatic-solutions.ch',NULL,1,0,1,0,0,9.27),(627,1,1,'Regular 2-Day Management 3.0 Course','EN',NULL,'EN','London','GB','The Management 3.0 Original 2-day Course is a workshop, a course, a book and a collection of concrete practices, to inspire team members and managers to transform their organizations to be more innovative and highly productive. Over the two days of the course, participants will experience theory and practice in small chunks, reflect on inspiring stories, work through fun games and exercises and focused group discussions.','In today\'s fast-moving, complex world, management is too important to leave it only to the managers. Everyone is a manager!\r\n\r\nThis workhop is for team members, entrepreneurs, changemakers, coaches, and managers who would like to practice leadership behaviours and make their workplace just a little bit better. ',0,'2015-09-17','2015-09-18',8,16,'http://leanadvantage.co.uk','https://www.eventbrite.co.uk/e/management-30-2-day-original-training-tickets-16598031158',0,0,1,0,0,9.00),(629,1,1,'Regular 2-Day Management 3.0 Course','SL',NULL,'EN','Ljubljana','SI','Special Scrum & Management 3.0 workshop for the jobseekers at Employment Service of Slovenia',NULL,0,'2015-05-25','2015-05-26',8,16,'http://www.agilspot.si/','http://www.agilspot.si/',1,0,1,0,0