uch, we’re trying to find new sweet spots and came up with the schedule here above. Consider this an experiment, and if you have feedback/suggestions, they are more than welcome.',0,'2015-09-30','2015-10-07',8,16,'https://www.arexo.be/management30/','https://www.arexo.be/management30/',0,0,1,0,0,7.50),(685,8,14,'2-Day Lean Change Agent Workshop','EN','EN','EN','Perth','AU','As a change agent, I’m sure you’ve experienced how difficult it can be to introduce change into an organization. That could mean you’re an Agile Coach or Scrum Master tasked with introducing Agile, and it can also mean you’re a Change Management Professional who is looking for more effective ways to develop and execute change programs.\r\nThis 2-day workshop, based on the book Lean Change Management,  is designed to help you discover more effective practices for introducing, and managing change in your organization.  You’ll learn by doing, not by reading PowerPoint slides! You’ll hear real stories about how to apply better, innovative practices to managing change.',NULL,0,'2015-06-22','2015-06-23',8,16,'https://www.change-management-institute.com/do-you-want-learn-how-manage-change-using-agile-practices-wa-aus','https://www.change-management-institute.com/do-you-want-learn-how-manage-change-using-agile-practices-wa-aus',0,0,1,0,0,9.00),(686,1,1,'Management 3.0 two-day course','PT','PT','PT','Rio de Janeiro','BR','O objetivo deste curso é ajudar a todos que buscam por uma gestão inspiradora, trabalhadores do conhecimento de qualquer nível até gerentes. Faremos isso por meio de aulas recheadas de dinâmicas, jogos, reflexões e discussões de problemas reais, de forma que o conhecimento possa ser rapidamente absorvido.',NULL,0,'2015-08-27','2015-08-28',8,16,'http://www.knowledge21.com.br','http://www.knowledge21.com.br/treinamentos/curso/management30/',0,0,1,0,0,10.00),(687,1,1,'Regular 2-Day Management 3.0 Course','EN',NULL,'EN','Helsinki','FI','Private class for a Nordic bank: Nordea\r\nClass ordered by Nordea Denmark and invoice will be sent to Nordea Denmark in Danish Kroner (DKK)',NULL,0,'2015-05-12','2015-05-13',8,16,NULL,NULL,1,0,1,0,0,0.00),(688,1,1,'Management 3.0  2-Tage Inhouse - Holtzbrinck Campus','DE',NULL,'DE','München','DE',NULL,NULL,0,'2015-05-21','2015-05-22',8,16,NULL,NULL,1,0,1,0,0,8.57),(689,1,1,'Management 3.0  2-Tage Inhouse Seminar - Daimler Corporate Academy','DE',NULL,'DE','Bad Boll','DE',NULL,NULL,0,'2015-06-25','2015-06-26',8,16,NULL,NULL,1,0,1,0,0,10.00),(690,1,1,'Management 3.0  2-Tage Inhouse - BDK','DE',NULL,'DE','Hamburg','DE',NULL,NULL,0,'2015-07-09','2015-07-10',8,16,NULL,NULL,1,0,1,0,0,8.50),(691,2,1,'Management 3.0 Workout 1-Tagesseminar','DE',NULL,'DE','München','DE','In seinem neuesten Buch \"Management 3.0 Workout\" hat Jurgen Appelo eine Vielzahl von Praktiken beschrieben, wie man Management 3.0 konkret in der Praxis umsetzen kann. Dieser Workshop dient zur Vertiefung der im zweitägigen Basistraining Management 3.0 erlernten Prinzipien und Praktiken. Der Besuch des Basistrainings wir daher empfohlen, er ist aber keine Voraussetzung für die Teilnahme am Management 3.0 Workout Seminar.','Im Preis inbegriffen sind: \r\n- deutsches Kurs- und Übungsmaterial\r\n- Essen und Getränke',0,'2015-11-11','2015-11-11',8,8,'http://www.cocondi.de/index.php/management-30','http://www.scrum-events.de/management-30-workout-workshop.html',0,0,0,0,0,0.00),(692,2,1,'Management 3.0 Workout 1-Tagesseminar','DE',NULL,'DE','Frankfurt/Main','DE','In seinem neuesten Buch \"Management 3.0 Workout\" hat Jurgen Appelo eine Vielzahl von Praktiken beschrieben, wie man Management 3.0 konkret in der Praxis umsetzen kann. Dieser Workshop dient zur Vertiefung der im zweitägigen Basistraining Management 3.0 erlernten Prinzipien und Praktiken. Der Besuch des Basistrainings wir daher empfohlen, er ist aber keine Voraussetzung für die Teilnahme am Management 3.0 Workout Seminar.','Im Preis inbegriffen sind: \r\n- deutsches Kurs- und Übungsmaterial\r\n- Essen und Getränke',50,'2015-10-07','2015-10-07',8,8,'http://www.cocondi.de/index.php/management-30','http://www.scrum-events.de/management-30-workout-workshop.html',0,0,1,0,0,9.67),(693,1,1,'Management 3.0 Course','EN',NULL,'EN','Luxembourg','LU',NULL,NULL,0,'2015-10-14','2015-10-15',8,16,'https://www.arexo.be/management30-luxembourg/','https://www.arexo.be/management30-luxembourg/',0,0,0,0,0,0.00),(695,1,1,'Agile Business Management (Management 3.0)','EN',NULL,'EN','Berlin','DE','This two-day Management 3.0 course aims to inspire Agile coaches and HR managers, technical and non-technical managers, team leaders and project managers who face the challenges of transforming their organizations to an Agile mindset. Our course provides practical tools and guidance to participants in order to apply new thinking to the craft, art and science of Leadership.',NULL,0,'2015-08-06','2015-08-07',8,16,'http://berlin30.eventbrite.com','http://berlin30.eventbrite.com',0,0,1,0,0,8.29),(696,10,1,'Tout le monde est manager!','FR','FR','FR','Geneva','CH','Le management est beaucoup trop important pour être laissé aux managers ! \r\n\r\nDans l\'effort de mobiliser les équipes, l\'autonomie de ces dernières est un facteur important pour le succès. Ceci implique aussi la délégation et le transfert de compétences décisionnelles. Mais que devient le management dans ce contexte ? \r\n\r\nLes retours d\'expérience nous montrent que bien souvent, le management et les chefs de projet freinent le développement des équipes agiles. Cette présentation vous propose une nouvelle vision sur le management dans l\'agilité et présente des pistes d\'évolution vers un management nouveau à travers des exercices concrets.\r\n',NULL,0,'2015-05-26','2015-05-26',1,1,'http://smartgecko.info/fr/management-3-0-sca-swiss-consulting-assosication/','http://www.meetup.com/Geneva-Management-3-0-Meetup/events/222550723/',0,0,1,1,0,0.00),(702,2,1,'Exclusive 1-Day #Workout Workshop','EN',NULL,'EN','Manchester','GB','As a founder entrepreneur or intrapreneur, have you ever wondered, how could you be more innovative in your company culture to create teams that gel naturally? How to handle key management topics - such as motivating, delegating, promoting and goal setting - in this critical phase of your business?','Founders, Intrapreneurs, Changemakers, Managers, Agile coaches, CEOs, Incubator members and startup teams',0,'2015-07-17','2015-07-17',8,8,'http://leanadvantage.co.uk','http://leanadvantage.co.uk',1,0,1,0,0,0.00),(703,10,1,'Diálogos Inovadores: Agile Managment - Gestão diante de complexidade','PT',NULL,NULL,'Curitiba','BR','Apresentação e dialogo sobre novas formas de gestão diante de complexidade e incertezas.\r\n\r\nPresentation about new forms of managment in times of complexity and uncertainty. ','Evento gratuito!\r\n\r\nFree event!',0,'2015-06-10','2015-06-10',2,2,'http://ibqp.org.br/agenda','hhttp://ibqp.org.br/agenda-detalhe/102/37/dialogos-inovadores-com-steffen-munzner',0,0,1,1,0,0.00),(704,1,1,'Management 3.0 Medellín - Curso Oficial de 2 días','ES','EN','ES','Medellín','CO','Management 3.0 es el nombre que Jurgen Appelo ha dado a su innovadora manera de enfocar la gestión de equipos y empresas desde una perspectiva Ágil. Su libro homónimo, publicado por Addison Wesley en la prestigiosa Mike Cohn Signature Series, ha sido uno de los más vendidos en Amazon en el apartado de metodologías Ágiles, y el blog de Jurgen es uno de los más seguidos por la comunidad Ágil internacional. Desde 2011, Proyectalis es Licensed Trainer de Management 3.0 siendo el único trainer en Castellano homologado hasta la fecha. En este curso de 2 días de duración se seguirán los conceptos expuestos en el libro de una forma teórica y práctica, con un gran énfasis en la participación de todos los asistentes en una experiencia de aprendizaje colectiva.','Este curso se orienta a líderes/gerentes que quieren hacerse Ágiles, y personas que deseen convertirse en excelentes jefes de equipo o jefes de departamento. No es necesaria ninguna experiencia práctica con métodos Ágiles, ya que no se trata de un curso de Scrum, Kanban o similares aproximaciones, aunque será útil estar familiarizado con los principios y prácticas ágiles. El objetivo del curso no es aprender metodologías Ágiles de desarrollo sino comprender mejor cómo tratar con equipos auto-organizados, cómo motivar a las personas, cómo abordar la complejidad de la organización, cómo definir estructuras organizativas Ágiles…\r\n\r\nEl curso normalmente atrae a jefes de equipo (15%), gerentes de desarrollo (15%), coaches ágiles (15%), scrum masters (15%), gerentes de proyecto (10%), product owners (10%), desarrolladores y testers (10%), y gerentes de alto nivel (10%). La valoración media de todos los cursos de Management 3.0 impartidos por todo el mundo es superior al 8.4.',0,'2015-06-10','2015-06-11',8,16,'http://www.kleer.la/','http://bit.ly/1JnmcLy',0,0,1,0,0,9.42),(705,2,1,'#Workout Workshop Medellín - evento oficial de 1 día','ES','EN','ES','Medellín','CO',NULL,NULL,0,'2015-06-12','2015-06-12',8,8,'http://www.kleer.la/','http://bit.ly/1Jnn3vE',0,0,1,0,0,9.14),(706,1,1,'2 jours - LILLE / SECLIN','FR',NULL,'FR','LILLE / SECLIN','FR',NULL,NULL,0,'2015-06-02','2015-06-03',8,16,'http://www.rupture21.com','https://www.zenika.com/formation-manager-agile.html',0,0,1,0,0,8.50),(707,1,1,'Management 3.0 - curso oficial 2 dias (SURA)','ES','EN','ES','Medellín','CO','Management 3.0 es el nombre que Jurgen Appelo ha dado a su innovadora manera de enfocar la gestión de equipos y empresas desde una perspectiva Ágil. Su libro homónimo, publicado por Addison Wesley en la prestigiosa Mike Cohn Signature Series, ha sido uno de los más vendidos en Amazon en el apartado de metodologías Ágiles, y el blog de Jurgen es uno de los más seguidos por la comunidad Ágil internacional. Desde 2011, Proyectalis es Licensed Trainer de Management 3.0 siendo el único trainer en Castellano homologado hasta la fecha. En este curso de 2 días de dur