nizados, cómo motivar a las personas, cómo abordar la complejidad de la organización, cómo definir estructuras organizativas Ágiles…\r\n\r\nEl curso normalmente atrae a jefes de equipo (15%), gerentes de desarrollo (15%), coaches ágiles (15%), scrum masters (15%), gerentes de proyecto (10%), product owners (10%), desarrolladores y testers (10%), y gerentes de alto nivel (10%). La valoración media de todos los cursos de Management 3.0 impartidos por todo el mundo es superior al 8.4.',37,'2015-09-09','2015-09-09',8,8,'http://www.proyectalis.com','http://www.proyectalis.com/2015/07/05/managament-3-0-workout-barcelona-septiembre-2015/',0,0,1,0,0,8.44),(730,1,1,'Management 3.0','TR',NULL,'EN','Istanbul','TR','Management 3.0 yönetim ve liderlik alanında yeni bir harekettir. Management 3.0 liderliği bütünsel bir sorumluluk olarak yeniden tanımlamaktadır. Management 3.0 felsefesi, çalışanların mutlululuğunu birincil öncelik olarak koruyup, iş hedeflerine ulaşabilmek için en etkin yolu birliktelik sağlayarak bulmak olduğuna inanır.\r\n\r\nBu yeni yaklaşım, organizasyonların tüm fonksiyonlarında (Satış, Üretim, Finans, İnsan Kaynakları, Operasyon, Bilgi Teknolojileri v.b.) yönetim pozisyonunda yer alan tüm takım yöneticilerinin, orta düzey yöneticilerin ve üst düzey yöneticilerin günümüzün değişime açık ve karmaşık iş ihtiyaçlarını yönetebilmek için kullanabilecekleri çok güçlü araçlar ile desteklenmektedir.\r\n\r\nBu yaklaşım gücünü öz örgütlenebilen (kendi kendine organize olabilen) ve sürekli gelişime açık, sorumluluk alan ekipler oluşturabilmesinden almaktadır.',NULL,154,'2015-07-04','2015-07-05',8,16,'http://www.yeldatavlan.com/anasayfa/egitimlerimiz/yonetim-ve-kisisel-gelisim-egitimleri/management-3-0/','info@martgeldi.com',1,0,1,0,0,9.50),(732,1,1,'Regular 2-Day Management 3.0 Course','PT',NULL,'PT','São Paulo','BR',NULL,NULL,0,'2015-07-30','2015-07-31',8,16,'http://adaptworks.com.br','http://adaptworks.com.br',0,0,1,0,0,0.00),(734,1,1,'Regular 2-Day Management 3.0 Course','FR','FR',NULL,'Montréal','CA',NULL,NULL,0,'2015-07-07','2015-07-08',8,16,NULL,NULL,0,0,1,0,0,0.00),(735,1,1,'Regular 2-Day Management 3.0 Course','FR','FR',NULL,'Montréal','CA',NULL,NULL,0,'2015-07-09','2015-07-10',8,16,NULL,NULL,1,0,1,0,0,0.00),(736,1,1,'Regular 2-Day Management 3.0 Course','FR','FR',NULL,'Montréal','CA',NULL,NULL,0,'2015-07-14','2015-07-15',8,16,NULL,NULL,1,0,1,0,0,0.00),(737,1,1,'2 jrs - PARIS','FR',NULL,'EN','PARIS','FR',NULL,NULL,0,'2015-06-28','2015-06-29',8,16,'http://www.rupture21.com','https://www.zenika.com/formation-manager-agile.html',0,0,1,0,0,9.00),(738,1,1,'Regular 2-Day Management 3.0 Course','EN','NL','EN','Utrecht area','NL','Regular 2-day workshop with Stephane Rondal and Anko Tijman as your trainers. \r\n',NULL,0,'2015-10-29','2015-10-30',8,16,'http://www.management30.nl','http://www.management30.nl/inschrijfformulier',0,0,0,0,0,0.00),(739,1,1,'Management 3.0 & Agilité - 3 jours - Nantes','FR',NULL,'EN','Nantes','FR','Le \"Management 3.0\" parle du rôle et des outils du manager dans un contexte agile où les équipes sont sensées être \"auto-organisées\". Ce stage de 3 jours s\'appuie sur le module de 2 jours développé par Jurgen Appelo, complété (ou plutôt précédé) par un approfondissement de l\'agilité, de ses principes moteurs et du rôle du manager dans ce contexte.\r\nNous allons travailler, la plupart du temps en petits groupes, et à partir de votre vécu de manager (et du mien), autour de 8 thématiques : \r\n\r\n* L\'agilité et la place du manager\r\n* Agir en complexité \r\n* La mobilisation des personnes\r\n* L\'autonomie des équipes\r\n* L\'alignement des contraintes\r\n* Le développement des compétences\r\n* L\'évolution de l\'organisation\r\n* La conduite du changement\r\n\r\nJe crois utile de préciser qu\'il ne s\'agit strictement ni d\'une formation sur les méthodes agiles, ni d\'une formation traditionnelle sur le management (les entretiens annuels, l\'entretien de recadrage, les sanctions ... etc.) même si cela a un peu à voir avec ces deux sujets. \r\nIl s\'agit d\'une succession d\'ateliers qui permettent de mettre en réflexion sa posture de manager dans un contexte d\'équipes agiles, de découvrir quelques nouveaux outils et de revisiter ceux qu\'on connait déjà mais qu\'on se sent parfois un peu \"empêché\" d\'utiliser quand on est face à une équipe agile.','Formation organisée à Nantes en partenariat avec Agile Garden',101,'2015-10-13','2015-10-15',7,21,'http://www.coactiv.fr','mailto:c.stauder@clt-services.com',0,0,0,0,0,0.00),(740,1,1,'Management 3.0 et Agilité - 3 jours - Paris','FR',NULL,'EN','Paris','FR','Le \"Management 3.0\" parle du rôle et des outils du manager dans un contexte agile où les équipes sont sensées être \"auto-organisées\". Ce stage de 3 jours s\'appuie sur le module de 2 jours développé par Jurgen Appelo, complété (ou plutôt précédé) par un approfondissement de l\'agilité, de ses principes moteurs et du rôle du manager dans ce contexte.\r\n\r\nNous allons travailler, la plupart du temps en petits groupes, et à partir de votre vécu de manager (et du mien), autour de 8 thématiques : \r\n\r\n* L\'agilité et la place du manager\r\n* Agir en complexité \r\n* La mobilisation des personnes\r\n* L\'autonomie des équipes\r\n* L\'alignement des contraintes\r\n* Le développement des compétences\r\n* L\'évolution de l\'organisation\r\n* La conduite du changement','Je crois utile de préciser qu\'il ne s\'agit strictement ni d\'une formation sur les méthodes agiles, ni d\'une formation traditionnelle sur le management (les entretiens annuels, l\'entretien de recadrage, les sanctions ... etc.) même si cela a un peu à voir avec ces deux sujets. \r\nIl s\'agit d\'une succession d\'ateliers qui permettent de mettre en réflexion sa posture de manager dans un contexte d\'équipes agiles, de découvrir quelques nouveaux outils et de revisiter ceux qu\'on connait déjà mais qu\'on se sent parfois un peu \"empêché\" d\'utiliser quand on est face à une équipe agile.',101,'