 ihmisten törmäytyspiste,\r\n* saat uusia ajatuksia,\r\n* saat uusia ideoita kokeiluihin,\r\n* saat sparrausta sekä toisia näkökulmia päivän polttaviin ongelmiisi.\r\n \r\n# Ensimmäinen sessio: Organisaatiot, johtaminen ja kompleksisuusteoria\r\n\r\nEnsimmäisen kerran teemana on organisaatioiden ja johtamisen trendit sekä kompleksisuusteoria.\r\n\r\nTässä sessiossa opit:\r\n\r\n* Mitkä ovat organisaatioiden eri ajatusmallit ja \r\n* miten tunnistat organisaatiossa vallitsevan kulttuurin ja ajatusmallin,\r\n* Miten ketteryys, lean ja teal-ajattelu (organisaatio elävänä organismina) on  kehittänyt johtamisajattelua sekä\r\n* miten systeemiajattelua ja kompleksisuusteoriaa voi hyödyntää organisaatiosuunnittelussa ja johtamisessa.','Työpajan jälkeen kutsumme osallistujat yhteispäivälliselle läheiseen ravintolaan keskustelemaan työpajan annista.\r\n\r\nSInulla on myös mahdollisuus osallistua työpajasarjan myöhempiin työpajoihin.',40,'2015-10-22','2015-10-22',4,4,'http://www.flowa.fi/','https://beyond-agile-hki.eventbrite.com',0,0,0,0,0,0.00),(779,1,1,'Management 3.0 two-day course','PT',NULL,'PT','Lisboa','PT',NULL,NULL,65,'2015-12-02','2016-01-03',8,264,'http://www.knowledge21.com.br','http://www.knowledge21.com.br/treinamentos/curso/management30/',0,0,0,0,0,0.00),(780,1,1,'Regular 2-Day Management 3.0 Course','EN',NULL,'EN','Copenhagen','DK',NULL,NULL,158,'2015-08-13','2015-08-14',8,16,'http://www.coregile.com',NULL,1,0,1,0,0,0.00),(781,1,1,'Management 3.0 two day course','SV',NULL,'EN','Stockholm','SE','Management 3.0 two day course at Informator. Books included.',NULL,64,'2015-10-20','2015-10-21',8,16,'http://www.knowit.se/Event/Stockholm/Management-30---Agilt-Ledarskap4/','http://informator.se/utbildningar/agila-metoder/agilt-ledarskap/management-30',0,0,0,0,0,0.00),(782,1,1,'Management 3.0 two day course','SV',NULL,'EN','Stockholm','SE','Management 3.0 two day course at Informator. Books included.',NULL,64,'2015-12-08','2015-12-09',8,16,'http://www.knowit.se/Event/