lp in the different workshop. Each Module exercice or game are done with English or Vietnamese materials depend on the audience.',157,'2015-10-19','2015-10-20',8,16,'http://smartdev.vn/services/agiletraining/#management30','http://smartdev.vn/services/agiletraining/#management30',0,0,0,0,1,0.00),(789,1,1,'Regular 2-Day Management 3.0 Course','DE',NULL,'DE','Nuremberg','DE','Private Inhouse event for Datev eG.',NULL,61,'2015-10-29','2015-10-30',8,16,'http://manageagile.com',NULL,1,0,0,0,0,0.00),(790,1,1,'Management 3.0 two-day course','PT',NULL,'PT','São Paulo','BR',NULL,NULL,65,'2015-11-24','2015-11-25',8,16,'http://www.knowledge21.com.br','http://www.knowledge21.com.br/treinamentos/curso/management30/',0,0,0,0,0,0.00),(791,1,1,'Management 3.0 Quito - Ecuador','ES','EN','ES','Quito','EC','Management 3.0 es el nombre que Jurgen Appelo ha dado a su innovadora manera de enfocar la gestión de equipos y empresas desde una perspectiva Ágil. Su libro homónimo, publicado por Addison Wesley en la prestigiosa Mike Cohn Signature Series, ha sido uno de los más vendidos en Amazon en el apartado de metodologías Ágiles, y el blog de Jurgen es uno de los más seguidos por la comunidad Ágil internacional. Desde 2011, Proyectalis es Licensed Trainer de Management 3.0 siendo el único trainer en Castellano homologado hasta la fecha. En este curso de 2 días de duración se seguirán los conceptos expuestos en el libro de una forma teórica y práctica, con un gran énfasis en la participación de todos los asistentes en una experiencia de aprendizaje colectiva.','Este curso se orienta a líderes/gerentes que quieren hacerse Ágiles, y personas que deseen convertirse en excelentes jefes de equipo o jefes de departamento. No es necesaria ninguna experiencia práctica con métodos Ágiles, ya que no se trata de un curso de Scrum, Kanban o similares aproximaciones, aunque será útil estar familiarizado con los principios y prácticas ágiles. El objetivo del curso no es aprender metodologías Ágiles de desarrollo sino comprender mejor cómo tratar con equipos auto-organizados, cómo motivar a las personas, cómo abordar la complejidad de la organización, cómo definir estructuras organizativas Ágiles…\r\n\r\nEl curso normalmente atrae a jefes de equipo (15%), gerentes de desarrollo (15%), coaches ágiles (15%), scrum masters (15%), gerentes de proyecto (10%), product owners (10%), desarrolladores y testers (10%), y gerentes de alto nivel (10%). La valoración media de todos los cursos de Management 3.0 impartidos por todo el mundo es superior al 8.4.',37,'2015-11-04','2015-11-05',8,16,'http://www.jaguaragil.com/management30.html','http://www.jaguaragil.com/management30.html',0,0,0,0,0,0.00),(792,2,1,'#Workout Workshop Quito - Ecuador','ES','EN','ES','Quito','EC','Basado en el tercer libro de Jurgen Appelo, Management #Workout introduce toda una serie de prácticas para aplicar Management 3.0 a las empresas del Siglo XXI. A través de juegos, dinámicas y ejercicios se introducirán herramientas como Merit Money, Kudo Box, Metrics Ecosystem, Improvement Dialogs, Feedback Wraps... EL objetivo del seminario es responder a las preguntas más comunes a las que se enfrentan los practicantes de Management 3.0:\r\n\r\n¿Cómo medir el rendimiento de los equipos y la mejora de la organización? ¿Cómo decidir salarios e incentivos? ¿Cómo definir títulos y carreras profesionales? ¿Cómo reemplazar las evaluaciones de rendimiento? ¿Cómo motivar a los trabajadores? ¿Cómo cambiar la cultura de la organización?','Especialmente indicado para personas que ya hayan completado el curso oficial de Management 3.0 de dos días o hayan leido el libro Management 3.0 (aunque no es imprescindible).\r\n\r\nEste curso se orienta a líderes/gerentes que quieren hacerse Ágiles, y personas que deseen convertirse en excelentes jefes de equipo o jefes de departamento. No es necesaria ninguna experiencia práctica con métodos Ágiles, ya que no se trata de un curso de Scrum, Kanban o similares aproximaciones, aunque será útil estar familiarizado con los principios y prácticas ágiles. El objetivo del curso no es aprender metodologías Ágiles de desarrollo sino comprender mejor cómo tratar con equipos auto-organizados, cómo motivar a las personas, cómo abordar la complejidad de la organización, cómo definir estructuras organizativas Ágiles…\r\n\r\nEl curso normalmente atrae a jefes de equipo (15%), gerentes de desarrollo (15%), coaches ágiles (15%), scrum masters (15%), gerentes de proyecto (10%), product owners (10%), desarrolladores y testers (10%), y gerentes de alto nivel (10%). La valoración media de todos los cursos de Management 3.0 impartidos por todo el mundo es superior al 8.4.',37,'2015-11-06','2015-11-06',8,8,'http://www.jaguaragil.com/management30.html','http://www.jaguaragil.com/management30.html',0,0,0,0,0,0.00),(794,1,1,'Inhouse 2-Day Management 3.0 Training - SIX Group','DE',NULL,'DE','Rüschlikon','CH',NULL,NULL,72,'2015-08-27','2015-08-28',8,16,'http://www.pragmatic-solutions.ch',NULL,1,0,1,0,0,8.82),(795,10,1,'keynote session','EN',NULL,NULL,'Istanbul','TR',NULL,NULL,23,'2015-10-09','2015-10-09',1,1,'http://www.summit.agileturkey.org/',NULL,0,0,1,1,0,0.00),(796,10,1,'keynote session','EN',NULL,NULL,'Prague','CZ',NULL,NULL,23,'2015-09-14','2015-09-14',1,1,'http://agileprague.com/',NULL,0,0,1,1,0,0.00),(797,1,1,'Management 3.0 Montevideo','ES','EN','ES','Montevideo','UY','Management 3.0 es el nombre que Jurgen Appelo ha dado a su innovadora manera de enfocar la gestión de equipos y empresas desde una perspectiva Ágil. Su libro homónimo, publicado por Addison Wesley en la prestigiosa Mike Cohn Signature Series, ha sido uno de los más vendidos en Amazon en el apartado de metodologías Ágiles, y el blog de Jurgen es uno de los más seguidos por la comunidad Ágil internacional. Desde 2011, Proyectalis es Licensed Trainer de Management 3.0 siendo el único trainer en Castellano homologado hasta la fecha. En este curso de 2 días de duración se seguirán los conceptos expuest