ntos/curso/management30/',0,0,1,0,0,9.00),(810,1,1,'Management 3.0 - Agile Leadership für Adaptive Organisationen (2 Tage)','DE',NULL,'EN','Vienna','AT','Agile Führungspraktiken und die Leadership-Agenda für Führungskräfte mit Weitblick. Ihre persönliche Leadership-Agenda für die adaptive Organisation.',NULL,45,'2015-11-30','2015-12-01',8,16,'http://agileexperts.at','http://agileexperts.at/management30-prereg/',0,0,0,0,0,0.00),(811,1,1,'Management 3.0 - Agile Leadership für Adaptive Organisationen (2 Tage)','EN',NULL,'EN','TBA','ZA','Reinventing Organizations, Agile Leadership and modern Management Practices. 2 days learning space for leaders & changemakers, no matter if you are a line manager, a Product Owner, ScrumMaster or team member. You even don\'t have to apply any Agile method, because we dive deep on Agile from a leadership and change perspective.\r\n\r\nLearn various options for growing Adaptive Organizations and how to successfully influence change, seeding a culture of trust and innovation.\r\n\r\n','Registration opening soon via our local partner! In the meanwhile as an early adopter, please drop us your interest via email.',45,'2016-02-02','2016-02-03',8,16,'http://agileexperts.at','mailto:contact@agileexperts.at',0,0,0,0,0,0.00),(812,2,1,'Management 3.0 - #Workout Workshop (1-Day)','EN',NULL,'EN','TBA','ZA','Management 3.0 Workout Workshops are highly interactive and creative events, where we elaborate new management practices. Based upon the Management 3.0 Workout collection we utilize various creative facilitation techniques to develop concrete approaches for participants own stories or our real-life case studies. \r\n\r\nDuring the workshop participants dive deeper on the concepts learnt during the preceding 2 days Management 3.0 course. Attendance of the 2 days Management 3.0 course is helpful, but not mandatory. ','Interested in this event? We will start registration with our local partner soon. In the meanwhile please drop us your interest via e