INSERT INTO `EXPERIMENT` VALUES (1,90,'Improving big hospital human enviroment.',0,'The biggest hospital in Nicaragua intents to change the behaviour of teams starting a \"cultural growing\" process. Our approach is to use M 3.0 to got it. ','https://www.dagconsultores.com'),(2,94,'Feedback Wall',1,'After helping with Spark the Change Toronto, I wanted to implement some of the tools at my second business, At My Office Canada. Why? Well the communicator in me loves the idea of giving encouragement and kudos. The ninja in me loves giving it when nobody\'s watching ...\r\n\r\nSo I\'ve set up a feedback wall and provided colorful cue cards, stickers and markers. We\'ll see how many ninjas we have.',NULL),(3,3,'Happy Melly Coffee',1,'Regular 30-minute chat about Great Questions about how to make a living and make a difference.',NULL),(4,5,'Lean Change Management Podcast',1,'Not only a podcast, but a public, recorded commentary with anyone who has an opinion to talk about the topics in the podcast!','http://leanchange.org/podcasts'),(5,70,'Management 3.0 in Portland Oregon',0,'Sponsor my first Management 3.0 course in Portland, being a new person to town and having to develop a network and find eager students for a public offering.\r\nPlans for early November and in January...',NULL),(6,29,'Job titles are not salaries',1,'Here at our company we went to a process to make people understand the difference between job titles and salaries, currently we don\'t have a transparent compensation plan (Salary Formula) so before the compensation action we should make people learn first.\r\nWe create a small workshop where people can create their own personal roles not restricting to \"market oriented\" roles therefore limiting their job actions inside the company.',NULL),(8,42,'Change Leadership via Lean Kanban and selected Lean Change tools',1,'People will redesign their organizations in a highly inspiring environment, in order to become fitter for purpose. Directly at the beach near Barcelona, participants will apply pragmatic state-of-the-art management methods for growing Adaptive Organizations. Using Lean Kanban together with selected Lean Change tools, they will be able to balance continuous improvement for existing business models with discovery processes for new business models.\r\n\r\nThis experiment about pragmatic management methods, creative facilitation techniques and inspiring environments will be continued based upon learnings in form of our \"change studio\" in 2016 in combination with other topics, other event formats and at other places.\r\n\r\nOur concept:\r\n\r\n+ combining most innovative, successful, up-to-date methods, tools and approaches\r\n+ collaborative learning space\r\n+ complementary learning assets (online transfer coaching, online peer group, meeting space)','http://agileexperts.at/trainings/kanban-beach-registration'),(9,79,'Virtual 1 Hour #Workout!',1,'If you haven\'t heard of Mangement 3.0 yet - then this is your chance to explore a few concepts about making a Happier Workplace, or Virtual space!  1 hour (free-ish) webinar.  Looking at the topic of Rewards & Incentives.  Dan Plink was RIGHT we need to rethink how we motivate people - and this 1 hour will give you some *actionable ideas* of what to do next!','http://www.humansideoftech.org/management30-virtual/'),(10,3,'Change Habitat',1,'Adapt and innovate faster by making the network--not the hierarchy--responsible for change.\r\n\r\nA **change habitat** is an environment in which change is natural. It is the home for a network of people who feel comfortable suggesting and implementing changes. It is an environment that workers are accustomed to living in.\r\n\r\nHappy Melly can help you create a change habitat.','https://drive.google.com/file/d/0B9xuqHFCF4WMRTNrdmk5cVhQcDg/view?usp=sharing'),(11,129,'Kudo Cards',0,'This is the one I have been eager to try since I have read about it :) In our company, it seems we have forgotten to thank people when they do something well (although, we have not forgotten how to blame people that have done something not-so-well). So, in my team, we are trying Kudo Cards and we will see how it goes and if we will be after time able to \"resurrect\" the simple habit of thanking to other people.','https://www.linkedin.com/pulse/have-we-forgotten-say-thanks-tomas-kejzlar'),(12,50,'CEO Bob: A book series about common management mistakes and how to address them.',0,'My experiment is to create a series of little books that address common managerial mistakes that can be fixed using modern management techniques like the ones brought to us by Management 3.0 (but not limited to just that). The format I envision is that of a children\'s book, but obviously not for children. Yes, it definitely involves pictures (very important in fact), but it\'s aimed at adults. It is actually not an uncommon format to address difficult topics. Still, a bit of tongue-in-cheek should be expected.\r\n\r\nI have written a first draft for one topic, and I\'m happy to share it to some HMX people to \"judge\" it. (Gosh, it feels like I\'m on X-Factor.) A few (native English speaking) folks have already read that draft and said it was quite good, even though there is some work to be done, both on the language side and on the story flow. (Still, this was a key result for me before going ahead and posting my idea here. I wasn\'t assuming any first attempt would be flawless.)\r\n\r\nNow, I have a couple of questions. I would like to draw on other people\'s experiences and ideas as to which \"common managerial mistakes\" could be addressed by such a series of books. So, what are your experiences?\r\n\r\nFinally (for now), I haven\'t taught myself how to draw (yet), so I\'m also looking for someone who can create illustrations around such stories. Nothing too serious, but definitely high quality and to the point.',NULL),(13,129,'My first blog post: do people really resist change?',0,'A week ago, I have written my first blog post, entitled \"Do People Really Resist Change?\" (I do not believe so). The goal for me is to get some feedback on my writing and get better at that. Writing also helps me in clarifying my own thoughts :) If you want to give me feedback, I will appreciate it.','https://www.linkedin.com/pulse/do-people-really-resist-change-tomas-kejzlar'),(15,1,'CEO Bob: A book series about common management mistakes and how to address them.',0,'My experiment is to create a series of little books that address common managerial mistakes that can be fixed using modern management techniques like the ones brought to us by Management 3.0 (but not limited to just that). The format I envision is that of a children\'s book, but obviously not for children. Yes, it definitely involves pictures (very important in fact), but it\'s aimed at adults. It is actually not an uncommon format to address difficult topics. Still, a bit of tongue-in-cheek should be expected.\r\n\r\nI have written a first draft for one topic, and I\'m happy to share it to some HMX people to \"judge\" it. (Gosh, it feels like I\'m on X-Factor.) A few (native English speaking) folks have already read that draft and said it was quite good, even though there is some work to be done, both on the language side and on the story flow. (Still, this was a key result for me before going ahead and posting my idea here. I wasn\'t assuming any first attempt would be flawless.)\r\n\r\nNow, I have a couple of questions. I would like to draw on other people\'s experiences and ideas as to which \"common managerial mistakes\" could be addressed by such a series of books. So, what are your experiences?\r\n\r\nFinally (for now), I haven\'t taught myself how to draw (yet), so I\'m also looking for someone who can create illustrations around such stories. Nothing too serious, but definitely high quality and to the point.','http://changegeek.ru');
