at\'s where we spend so much time every single day. I seem to pick up on colleagues\' distress and frustrations (not to mention my own) and feel the need to address the underlying issues. It sounds corny, but life\'s too damn short to just accept the way things are (even when they make you unhappy), and I refuse to do so. ',0,'2015-06-08 04:00:35',933,'2015-06-08 04:00:35',933),(51,935,1,0,'EUR',10.000,1,'2015-06-08','2016-06-08',NULL,0,'2015-06-08 15:38:59',935,'2015-06-08 15:38:59',935),(52,953,1,0,'EUR',40.000,1,'2015-06-10','2016-06-10','I joined the Happy Melly network to be part of something exciting - an international movement to be (and help others be) happy at work. ',0,'2015-06-10 13:26:38',953,'2015-06-10 13:26:38',953),(53,955,1,0,'EUR',30.000,1,'2015-06-10','2016-06-10',NULL,0,'2015-06-10 18:07:10',955,'2015-06-10 18:07:10',955),(54,950,1,0,'EUR',20.000,1,'2015-06-12','2016-06-12','change leadership point of view in organizations',0,'2015-06-12 07:38:16',950,'2015-06-12 07:38:16',950),(55,961,1,0,'EUR',10.000,1,'2015-06-12','2016-06-12',NULL,0,'2015-06-12 13:49:42',961,'2015-06-12 13:49:42',961),(56,969,1,0,'EUR',10.000,1,'2015-06-13','2016-06-13',NULL,0,'2015-06-13 13:37:34',969,'2015-06-13 13:37:34',969),(57,117,1,1,'EUR',2000.000,0,'2015-06-01','2016-06-01',NULL,0,'2015-06-13 14:35:23',22,'2015-06-13 14:35:23',22),(58,976,1,0,'EUR',15.000,1,'2015-06-15','2016-06-15',NULL,0,'2015-06-15 08:58:32',976,'2015-06-15 08:58:32',976),(59,33,1,1,'EUR',800.000,0,'2015-03-01','2016-03-01',NULL,0,'2015-06-16 14:28:58',22,'2015-06-16 14:28:58',22),(60,1003,1,0,'EUR',40.000,1,'2015-06-17','2016-06-17',NULL,0,'2015-06-17 17:12:01',1003,'2015-06-17 17:12:01',1003),(61,157,0,0,'EUR',10.000,1,'2015-06-22','2016-06-22',NULL,0,'2015-06-22 09:12:29',60,'2015-06-22 09:12:29',60),(62,1065,1,0,'EUR',30.000,1,'2015-06-24','2016-06-24',NULL,0,'2015-06-24 20:09:54',1065,'2015-06-24 20:09:54',1065),(63,159,0,0,'EUR',25.000,1,'2015-06-24','2016-06-24',NULL,0,'2015-06-24 21:58:19',1066,'2015-06-24 21:58:19',1066),(64,1073,1,0,'EUR',80.000,1,'2015-06-25','2016-06-25',NULL,0,'2015-06-25 15:50:15',1073,'2015-06-25 15:50:15',1073),(65,1075,1,0,'EUR',50.000,1,'2015-06-26','2016-06-26',NULL,0,'2015-06-26 15:55:04',1075,'2015-06-26 15:55:04',1075),(66,1077,1,0,'EUR',10.000,1,'2015-06-26','2016-06-26',NULL,0,'2015-06-26 21:15:42',1077,'2015-06-26 21:15:42',1077),(67,161,0,0,'EUR',25.000,1,'2015-06-29','2016-06-29',NULL,0,'2015-06-29 17:01:38',1103,'2015-06-29 17:01:38',1103),(68,1101,1,0,'EUR',20.000,1,'2015-06-30','2016-06-30',NULL,0,'2015-06-30 09:19:59',1101,'2015-06-30 09:19:59',1101),(69,1111,1,0,'EUR',50.000,1,'2015-07-01','2016-07-01',NULL,0,'2015-07-01 10:02:52',1111,'2015-07-01 10:02:52',1111),(70,1133,1,0,'EUR',50.000,1,'2015-07-03','2016-07-03','I am very happy about this work and how such important and complex information has been made so fun and accessible. I am excited to help spread the exercises, artifacts, and experiences throughout the world. Times are going to be more and more uncertain and possibly difficult and our ability to learn, adapt, be agile, and have fun is quite important to me. \n\nThank you for providing this great work and opportunity. I am excited to learn enough to spread the work and contribute as well. Per the words of the Hopi Elders, it is good to be in this river with you.\n\n**Hopi Elders Speak**\n\n>You have been telling the people that this is the Eleventh Hour, now you must go back and tell the people that this is the Hour.  And there are things to be considered:\n>\n>Where are you living?\n>\n>What are you doing?\n>\n>What are your relationships?\n>\n>Are you in right relation?\n>\n>Where is your water?\n>\n>Know your garden.\n>\n>It is time to speak your Truth.\n>\n>Create your community.\n>\n>Be good to each other.\n>\n>And do not look outside yourself for the leader.\n>\n>Then he clasped his hands together, smiled, and said; This could be a good time!\n>\n>There is a river flowing now very fast.  It is so great and swift that there are those who will be afraid.  They will try to hold on to the shore.   They will feel they are torn apart and will suffer greatly. \n>\n>Know the river has its destination.  The elders say we must let go of the shore, push off into the middle of the river, keep our eyes open, and our heads above water.   And I say, see who is in there with you and celebrate.  At this time in history, we are to take nothing personally, Least of all ourselves.  For the moment that we do,  our spiritual growth and journey comes to a halt. \n>\n>The time for the lone wolf is over.  Gather yourselves!  Banish the word struggle from you attitude and your vocabulary.  All that we do now must be done in a sacred manner and in celebration. \n>\n>       We are the ones we\'ve been waiting for.\n>\n\nattributed to an unnamed Hopi elder\n\nHopi Nation\n\nOraibi, Arizona',0,'2015-07-03 17:10:14',1133,'2015-07-03 17:10:14',1133),(71,131,0,0,'EUR',30.000,1,'2015-07-04','2016-07-04',NULL,0,'2015-07-04 17:36:16',119,'2015-07-04 17:36:16',119),(72,1136,1,0,'EUR',20.000,1,'2015-07-05','2016-07-05',NULL,0,'2015-07-05 17:16:06',1136,'2015-07-05 17:16:06',1136),(73,1140,1,0,'EUR',20.000,1,'2015-07-06','2016-07-06',NULL,0,'2015-07-06 12:30:41',1140,'2015-07-06 12:30:41',1140),(74,1150,1,0,'EUR',10.000,1,'2015-07-07','2016-07-07',NULL,0,'2015-07-07 11:02:40',1150,'2015-07-07 11:02:40',1150),(75,1164,1,0,'EUR',20.000,1,'2015-07-08','2016-07-08',NULL,0,'2015-07-08 15:38:45',1164,'2015-07-08 15:38:45',1164),(76,1181,1,0,'EUR',25.000,1,'2015-07-13','2016-07-13',NULL,0,'2015-07-13 00:44:10',1181,'2015-07-13 00:44:10',1181),(77,1182,1,0,'EUR',40.000,1,'2015-07-13','2016-07-13','I\'m an Happy creative workers and networker. I want to teach people how they can manage differently to focus on their coworkers\' happiness',0,'2015-07-13 08:23:15',1182,'2015-07-13 08:23:15',1182),(78,1197,1,0,'EUR',50.000,1,'2015-07-14','2016-07-14',NULL,0,'2015-07-14 01:29:18',1197,'2015-07-14 01:29:18',1197),(79,1200,1,0,'EUR',15.000,1,'2015-07-14','2016-07-14','being miserable at work is so 20th century.  We have the opportunity to write a new story - and I want to be part of it!',0,'2015-07-14 11:38:46',1200,'2015-07-14 11:38:46',1200),(80,1201,1,0,'EUR',15.000,1,'2015-07-14','2016-07-14',NULL,0,'2015-07-14 16:30:45',1201,'2015-07-14 16:30:45',1201),(81,154,0,0,'EUR',20.000,1,'2015-07-15','2016-07-15',NULL,0,'2015-07-15 07:57:43',1151,'2015-07-15 07:57:43',1151),(82,1151,1,0,'EUR',20.000,1,'2015-07-15','2016-07-15',NULL,0,'2015-07-15 07:59:41',1151,'2015-07-15 07:59:41',1151),(83,1209,1,0,'EUR',20.000,1,'2015-07-15','2016-07-15',NULL,0,'2015-07-15 10:44:32',1209,'2015-07-15 10:44:32',1209),(84,1262,1,0,'EUR',40.000,1,'2015-07-23','2016-07-23',NULL,0,'2015-07-23 13:18:12',1262,'2015-07-23 13:18:12',1262),(85,166,0,0,'EUR',100.000,1,'2015-07-23','2016-07-23',NULL,0,'2015-07-23 22:37:03',1264,'2015-07-23 22:37:03',1264),(86,1264,1,0,'EUR',40.000,1,'2015-07-23','2016-07-23',NULL,0,'2015-07-23 22:51:11',1264,'2015-07-23 22:51:11',1264),(87,167,0,0,'EUR',20.000,1,'2015-07-24','2016-07-24',NULL,0,'2015-07-24 15:47:35',1265,'2015-07-24 15:47:35',1265),(88,1266,1,0,'EUR',40.000,1,'2015-07-25','2016-07-25',NULL,0,'2015-07-25 08:40:05',1266,'2015-07-25 08:40:05',1266),(89,1268,1,0,'EUR',15.000,1,'2015-07-26','2016-07-26',NULL,0,'2015-07-26 18:34:39',1268,'2015-07-26 18:34:39',1268),(90,1272,1,0,'EUR',10.000,1,'2015-07-27','2016-07-27',NULL,0,'2015-07-27 13:09:02',1272,'2015-07-27 13:09:02',1272),(91,172,0,0,'EUR',80.000,1,'2015-07-27','2016-07-27',NULL,0,'2015-07-27 15:44:50',1275,'2015-07-27 15:44:50',1275),(92,1273,1,0,'EUR',15.000,1,'2015-07-28','2016-07-28','I believe having happy professionals is key to have successful organisations.',0,'2015-07-28 09:10:26',1273,'2015-07-28 09:10:26',1273),(93,1279,1,0,'EUR',15.000,1,'2015-07-28','2016-07-28','I have seen many change initiatives gone wrong because of cultural difficulties. I\'m strongly convinced that a lean/agile approach to any change can give a change initiative a much greater chance of succeeding. I\'m attracted to the Happy Melly Network because I can find many of the best thinkers around modern organisations in it... and I want to learn!',0,'2015-07-28 18:39:13',1279,'2015-07-28 18:39:13',1279),(94,173,0,0,'EUR',40.000,1,'2015-07-29','2016-07-29',NULL,0,'2015-07-29 19:01:24',1280,'2015-07-29 19:01:24',1280),(95,128,0,0,'EUR',80.000,1,'2015-07-30','2016-07-30',NULL,0,'2015-07-30 13:01:47',159,'2015-07-30 13:01:47',159),(96,1288,1,0,'EUR',15.000,1,'2015-08-03','2016-08-03','because I believe in a better place',0,'2015-08-03 08:43:50',1288,'2015-08-03 08:43:50',1288),(97,1292,1,0,'EUR',25.000,1,'2015-08-04','2016-08-04',NULL,0,'2015-08-04 16:33:39',1292,'2015-08-04 16:33:39',1292),(98,105,0,0,'EUR',40.000,1,'2015-08-05','2016-08-05',NULL,0,'2015-08-05 11:12:34',169,'2015-08-05 11:12:34',169),(99,174,0,0,'EUR',25.000,0,'2015-08-05','2016-08-05',NULL,0,'2015-08-05 23:30:51',1294,'2015-08-05 23:30:51',1294),(100,1297,1,0,'EUR',20.000,1,'2015-08-07','2016-08-07',NULL,0,'2015-08-07 09:53:19',1297,'2015-08-07 09:53:19',1297),(101,1304,1,0,'EUR',10.000,1,'2015-08-12','2016-08-12','Because, i want people be happy in work, and want to work to do that in my place.',0,'2015-08-12 15:12:43',1304,'2015-08-12 15:12:43',1304),(102,1307,1,0,'EUR',10.000,1,'2015-08-12','2016-08-12',NULL,0,'2015-08-12 23:41:38',1307,'2015-08-12 23:41:38',1307),(103,175,0,0,'EUR',20.000,0,'2015-08-13','2016-08-13',NULL,0,'2015-08-13 21:23:37',1312,'2015-08-13 21:23:37',1312),(104,50,0,0,'EUR',80.000,1,'2015-08-17','2016-08-17',NULL,0,'2015-08-17 11:18:21',40,'2015-08-17 11:18:21',40),(105,68,1,0,'EUR',42.000,1,'2015-08-18','2016-08-18','I joined the Happy Melly network to promote happiness at work and help organisations to re-invent their traditional mindset and structures that is optimized for the past.',0,'2015-08-18 06:37:50',68,'2015-08-18 06:37:50',68),(106,1331,1,0,'EUR',15.000,1,'2015-08-18','2016-08-18',NULL,0,'2015-08-18 21:58:00',1331,'2015-08-18 21:58:00',1331),(107,1363,1,0,'EUR',40.000,1,'2015-08-25','2016-08-25','To help others, heal organisations, teams and other creative workers where they want it.\n\nI really want to help others learn and change effectively, holistically and ethically. I really believe that Happy Melly is the best place to help me do that.',0,'2015-08-25 08:29:40',1363,'2015-08-25 08:29:40',1363),(108,1369,1,0,'EUR',30.000,1,'2015-08-26','2016-08-26',NULL,0,'2015-08-26 21:37:28',1369,'2015-08-26 21:37:28',1369),(109,1371,1,0,'EUR',40.000,1,'2015-08-29','2016-08-29',NULL,0,'2015-08-29 12:06:02',1371,'2015-08-29 12:06:02',1371),(110,1388,1,0,'EUR',40.000,1,'2015-09-02','2016-09-02',NULL,0,'2015-09-02 13:56:44',1388,'2015-09-02 13:56:44',1388),(111,1407,1,0,'EUR',21.000,1,'2015-09-05','2016-09-05','It makes me happy to help people have fun with their work.\n\nIt makes me more happy to help people help themselves to have fun with their work.\n\nIt makes me most happy to write complicated sentences to show people what makes me happy to help people smile at their work.',0,'2015-09-05 16:50:04',1407,'2015-09-05 16:50:04',1407),(112,1411,1,0,'EUR',40.000,1,'2015-09-06','2016-09-06',NULL,0,'2015-09-06 20:09:26',1411,'2015-09-06 20:09:26',1411),(113,1432,1,0,'EUR',30.000,1,'2015-09-09','2016-09-09','Happy Melly\'s sources, information and philosophy are a constant inspiration for what I\'m trying to share with others via an initiative I\'m setting up. ',0,'2015-09-09 09:50:34',1432,'2015-09-09 09:50:34',1432),(114,1433,1,0,'EUR',15.000,1,'2015-09-09','2016-09-09','I believe in transparency, communication and empowerment. Everybody has something to share!! :)',0,'2015-09-09 10:45:55',1433,'2015-09-09 10:45:55',1433),(115,1440,1,0,'EUR',30.000,1,'2015-09-09','2016-09-09','After many years of experience I am convinced that each product, project, service, brand, business has a spirit, the spirit of the passion and attitude of the team that created it, the passion and happiness is the key factor for the success. Be happy.',0,'2015-09-09 20:10:38',1440,'2015-09-09 20:10:38',1440),(116,1489,1,0,'EUR',25.000,1,'2015-09-15','2016-09-15',NULL,0,'2015-09-15 09:55:35',1489,'2015-09-15 09:55:35',1489),(117,1492,1,0,'EUR',80.000,1,'2015-09-15','2016-09-15',NULL,0,'2015-09-15 14:38:59',1492,'2015-09-15 14:38:59',1492),(118,1495,1,0,'EUR',50.000,1,'2015-09-16','2016-09-16',NULL,0,'2015-09-16 16:47:33',1495,'2015-09-16 16:47:33',1495),(119,1496,1,0,'EUR',100.000,1,'2015-09-17','2016-09-17','.... is because I believe in sharing happiness. And collectively we\'ll have a much better chance of exorcising the zombies...',0,'2015-09-17 00:21:26',1496,'2015-09-17 00:21:26',1496),(120,1498,1,0,'EUR',15.000,1,'2015-09-17','2016-09-17',NULL,0,'2015-09-17 09:33:49',1498,'2015-09-17 09:33:49',1498),(121,1500,1,0,'EUR',10.000,0,'2015-09-17','2016-09-17',NULL,0,'2015-09-17 11:47:58',1500,'2015-09-17 11:47:58',1500),(122,1507,1,0,'EUR',10.000,1,'2015-09-18','2016-09-18',NULL,0,'2015-09-18 14:36:14',1507,'2015-09-18 14:36:14',1507),(123,1510,1,0,'EUR',50.000,1,'2015-09-18','2016-09-18','I believe work doesn\'t need to be and shouldn\'t be something people spend their time wishing it was over.  Backing into their parking spots in the morning so they can leave quicker in the afternoon.\n\nI want to collaborate with others who share a similar view so that a little by little we may make our work places a better.  So we can make our workplaces -- happyplaces.',0,'2015-09-18 16:53:35',1510,'2015-09-18 16:53:35',1510),(124,1513,1,0,'EUR',15.000,1,'2015-09-20','2016-09-20','**…** because I believe in _teamwork_ and _networks_!\n**…** because I want to _share_ and _contribute_!\n**…** because I want to _experiment_ and _learn_!\n',0,'2015-09-20 18:38:49',1513,'2015-09-20 18:38:49',1513),(125,1518,1,0,'EUR',20.000,1,'2015-09-21','2016-09-21','I\'m happiest when I help others. I\'ve been working with Agile teams for a long time and it\'s been a blast. Recently though, I\'ve been working in an environment where we\'re being told when to do it, how to do it, and being threatened with our jobs if we fail - I\'ve been left feeling quite demotivated. I\'m here - hopefully to surround myself with generous and awesome people so that I can find my mojo. ',0,'2015-09-21 09:59:21',1518,'2015-09-21 09:59:21',1518),(126,121,1,1,'EUR',1000.000,0,'2015-09-22','2016-09-22',NULL,0,'2015-09-22 20:54:14',25,'2015-09-22 20:54:14',25),(127,76,1,1,'EUR',1000.000,0,'2015-09-22','2016-09-22',NULL,0,'2015-09-22 20:54:49',25,'2015-09-22 20:54:49',25),(128,1550,1,0,'EUR',5.000,0,'2015-09-24','2016-09-24',NULL,0,'2015-09-24 05:28:02',1550,'2015-09-24 05:28:02',1550),(129,1556,1,0,'EUR',15.000,1,'2015-09-24','2016-09-24','I joined the Happy Melly network because I believe that only happy people, who have interest in their work can achieve great results and internal satisfaction. And because I have seen many unhappy people bored, frustrated or in hate of their work, I really want to set an example and promote happiness at work.',0,'2015-09-24 17:16:50',1556,'2015-09-24 17:16:50',1556),(130,1566,1,0,'EUR',50.000,1,'2015-09-28','2016-09-28',NULL,0,'2015-09-28 22:38:29',1566,'2015-09-28 22:38:29',1566),(131,36,1,0,'EUR',40.000,1,'2015-09-29','2016-09-29',NULL,0,'2015-09-29 15:43:05',36,'2015-09-29 15:43:05',36),(132,1575,1,0,'EUR',40.000,1,'2015-09-30','2016-09-30','People who are being challenged, respected and stimulated to develop and use a growth mindset will be super happy workers!',0,'2015-09-30 16:49:11',1575,'2015-09-30 16:49:11',1575),(133,1577,1,0,'EUR',20.000,0,'2015-10-01','2016-10-01',NULL,0,'2015-10-01 02:07:19',1577,'2015-10-01 02:07:19',1577),(134,170,1,0,'EUR',10.000,1,'2015-10-01','2016-10-01',NULL,0,'2015-10-01 03:11:07',170,'2015-10-01 03:11:07',170),(135,1591,1,0,'EUR',20.000,1,'2015-10-01','2016-10-01',NULL,0,'2015-10-01 15:56:55',1591,'2015-10-01 15:56:55',1591),(136,1598,1,0,'EUR',40.000,1,'2015-10-04','2016-10-04','To be part of a positive community!\n\n',0,'2015-10-04 02:50:04',1598,'2015-10-04 02:50:04',1598),(137,1609,1,0,'EUR',5.000,1,'2015-10-05','2016-10-05','A better world by bringing joy, consciousness and freedom to our working environments.',0,'2015-10-05 17:54:14',1609,'2015-10-05 17:54:14',1609),(138,1614,1,0,'EUR',20.000,1,'2015-10-07','2016-10-07','Who made us believe work is boring by nature? Ourselves.\nSo, it\'s also our mission to replace this concept with the idea of happiness at work :-) That\'s why I joined Happy Melly!',0,'2015-10-07 01:06:51',1614,'2015-10-07 01:06:51',1614),(139,1643,1,0,'EUR',40.000,1,'2015-10-07','2016-10-07',NULL,0,'2015-10-07 08:35:29',1643,'2015-10-07 08:35:29',1643),(140,1649,1,0,'EUR',25.000,1,'2015-10-07','2016-10-07',NULL,0,'2015-10-07 22:44:42',1649,'2015-10-07 22:44:42',1649),(141,1696,1,0,'EUR',60.000,1,'2015-10-09','2016-10-09','To share and learn stories, techniques, motivations for creating beautiful companies and happier places to work.',0,'2015-10-09 20:00:41',1696,'2015-10-09 20:00:41',1696),(142,1698,1,0,'EUR',40.000,1,'2015-10-10','2016-10-10',NULL,0,'2015-10-10 17:02:59',1698,'2015-10-10 17:02:59',1698),(143,1759,1,0,'EUR',20.000,1,'2015-10-14','2016-10-14','Change... Some people are happy to start out with... others have to change to be happy.  Change and transformation start from within.  I\'ve been there.  I want to help others to get there.  I joined Happy Melly to spread the joy, love and hope that change is possible.  \n',0,'2015-10-14 12:25:23',1759,'2015-10-14 12:25:23',1759),(144,1762,1,0,'EUR',10.000,1,'2015-10-24','2016-10-24',NULL,0,'2015-10-24 16:49:04',1762,'2015-10-24 16:49:04',1762),(145,1763,1,0,'EUR',20.000,1,'2015-10-31','2016-10-31',NULL,0,'2015-10-31 10:46:22',1763,'2015-10-31 10:46:22',1763);
