nt LICENSEE_FK foreign key(LICENSEE_ID) references PERSON(ID) on update NO ACTION on delete NO ACTION;\nalter table LICENSE add constraint BRAND_FK foreign key(BRAND_ID) references BRAND(ID) on update NO ACTION on delete NO ACTION;\n\ninsert into LICENSE values (1, 1, 1, \'2013-01-01\', \'2013-12-31\');\ninsert into LICENSE values (2, 2, 1, \'2013-01-01\', \'2013-12-31\');\ninsert into LICENSE values (3, 3, 1, \'2013-01-01\', \'2013-12-31\');\ninsert into LICENSE values (4, 4, 1, \'2013-01-01\', \'2013-12-31\');','delete from BRAND;\ninsert into BRAND values (1, \'Command & Control 1.0\', 1);\ninsert into BRAND values (2, \'Vintage Scientific Management\', 2);','applied',''),(9,'0134627d493f09dab3c74b79660ac31df90b6ae4','2015-03-16 12:44:00','alter table LOGIN_IDENTITY add column API_TOKEN char(40);\nupdate LOGIN_IDENTITY set API_TOKEN = \'a14ac0a6010a3f6f78b78155918b9758103f12a7\' where twitter_handle=\'PeterHilton\';\nupdate LOGIN_IDENTITY set API_TOKEN = \'18919c6f6e67d16034b8118e362ba6310db02409\' where twitter_handle=\'jurgenappelo\';\nupdate LOGIN_IDENTITY set API_TOKEN = \'163c19dfa1f2aa30ecb4c1f87f3728f5216d740f\' where twitter_handle=\'skotlov\';\nupdate LOGIN_IDENTITY set API_TOKEN = \'c9f6b9138219d00ba9392202d0dc47004c22d32b\' where twitter_handle=\'Targeter\';','alter table LOGIN_IDENTITY drop column API_TOKEN;','applied',''),(10,'d0b46dd7b4cb6ae3d8b7756991c01b82d7d9d37a','2015-03-16 12:44:00','alter table ORGANISATION add column CREATED TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP;\nalter table ORGANISATION add column CREATED_BY VARCHAR(254) NOT NULL DEFAULT \'Peter Hilton\';','alter table ORGANISATION drop column CREATED;\nalter table ORGANISATION drop column CREATED_BY;','applied',''),(11,'0d5adf562e3c28bd4e5cc112f327bfd8f8949ba2','2015-03-16 12:44:00','-- Repair empty values for CREATED.\nupdate ORGANISATION set CREATED = CURRENT_TIMESTAMP where CREATED = \'0000-00-00 00:00:00\';\n\nalter table ORGANISATION add column UPDATED TIMESTAMP;\nupdate ORGANISATION set UPDATED = CREATED;\nalter table ORGANISATION modify column UPDATED TIMESTAMP NOT NULL;\n\nalter table ORGANISATION add column UPDATED_BY VARCHAR(254) NOT NULL DEFAULT \'Peter Hilton\';','alter table ORGANISATION drop column UPDATED;\nalter table ORGANISATION drop column UPDATED_BY;','applied',''),(12,'d52590366d9dcd578e66e0aeb31ef6b53cab2e11','2015-03-16 12:44:01','alter table PERSON add column EMAIL_ADDRESS VARCHAR(254) NOT NULL;\nalter table PERSON add column STREET_1 VARCHAR(254);\nalter table PERSON add column STREET_2 VARCHAR(254);\nalter table PERSON add column CITY VARCHAR(254);\nalter table PERSON add column PROVINCE VARCHAR(254);\nalter table PERSON add column POST_CODE VARCHAR(254);\n\nalter table PERSON add column BIO TEXT;\nalter table PERSON add column INTERESTS TEXT;\nalter table PERSON add column TWITTER_HANDLE VARCHAR(254);\nalter table PERSON add column FACEBOOK_URL VARCHAR(254);\nalter table PERSON add column LINKEDIN_URL VARCHAR(254);\nalter table PERSON add column GOOGLE_PLUS_URL VARCHAR(254);\nalter table PERSON add column BOARD_MEMBER BOOLEAN NOT NULL DEFAULT 0;\nalter table PERSON add column STAKEHOLDER BOOLEAN NOT NULL DEFAULT 1;\n\nalter table PERSON add column CREATED TIMESTAMP NOT NULL;\nupdate PERSON set CREATED = CURRENT_TIMESTAMP;\nalter table PERSON add column CREATED_BY VARCHAR(254) NOT NULL;','alter table PERSON drop column EMAIL_ADDRESS;\nalter table PERSON drop column STREET_1;\nalter table PERSON drop column STREET_2;\nalter table PERSON drop column CITY;\nalter table PERSON drop column PROVINCE;\nalter table PERSON drop column POST_CODE;\n\nalter table PERSON drop column BIO;\nalter table PERSON drop column INTERESTS;\nalter table PERSON drop column TWITTER_HANDLE;\nalter table PERSON drop column FACEBOOK_URL;\nalter table PERSON drop column LINKEDIN_URL;\nalter table PERSON drop column GOOGLE_PLUS_URL;\nalter table PERSON drop column BOARD_MEMBER;\nalter table PERSON drop column STAKEHOLDER;\n\nalter table PERSON drop column CREATED;\nalter table PERSON drop column CREATED_BY;','applied',''),(13,'13a4b8599c6a118bd5adf0c89b1e67abd35b9934','2015-03-16 12:44:01','update PERSON set EMAIL_ADDRESS = concat(lower(FIRST_NAME), \'.\', lower(LAST_NAME), \'@happymelly.com\') where EMAIL_ADDRESS is null;\n\ninsert into PERSON (FIRST_NAME, LAST_NAME, EMAIL_ADDRESS, STREET_1, CITY, POST_CODE, COUNTRY_CODE, BIO, INTERESTS, TWITTER_HANDLE, FACEBOOK_URL, LINKEDIN_URL, GOOGLE_PLUS_URL, BOARD_MEMBER, STAKEHOLDER, CREATED, CREATED_BY)\nvalues (\'Jurgen\', \'Appelo\', \'jurgen@noop.nl\', \'Palais Royal\', \'Brussels\', \'1000\', \'BE\', \'Jurgen Appelo is a writer, speaker, trainer, entrepreneur, illustrator, developer, manager, blogger, reader, dreamer, leader, freethinker, and… _Dutch guy_.\n\nSince 2008 Jurgen writes a popular blog at [www.noop.nl](http://www.noop.nl/), that covers topics including Agile management, software engineering, business improvement, personal development, and complexity theory. He is the author of the book Management 3.0: Leading Agile Developers, Developing Agile Leaders, which describes the role of the manager in Agile organizations. And he wrote the little book How to Change the World, which describes his new supermodel for change management. He is also a speaker who is regularly invited to talk at business seminars and conferences around the world.\', \'After studying Software Engineering at the Delft University of Technology, and earning his Master’s degree in 1994, Jurgen Appelo has busied himself starting up and leading a variety of Dutch businesses, always in the position of team leader, manager, or executive. Jurgen has experience in leading a horde of 100 software developers, development managers, project managers, business consultants, quality managers, service managers, and kangaroos, some of which he hired accidentally.\', \'jurgenappelo\', \'https://www.facebook.com/jurgenappelo\', \'https://www.linkedin.com/in/jurgenappelo\', \'https://plus.google.com/113426236640644815069\', 1, 0, current_timestamp, \'Peter Hilton\');','delete from PERSON where EMAIL_ADDRESS = \'jurgen@noop.nl\';','applied',''),(14,'01fd4618f35286b76005c5008b10f84f9deeae99','2015-03-16 12:44:01','alter table BRAND add column CREATED TIMESTAMP NOT NULL;\nalter table BRAND add column CREATED_BY VARCHAR(254) NOT NULL;\nalter table BRAND add column UPDATED TIMESTAMP NOT NULL;\nalter table BRAND add column UPDATED_BY VARCHAR(254) NOT NULL;\nalter table BRAND modify CODE VARCHAR(5) ;\nupdate BRAND set CODE = upper(CODE), CREATED = CURRENT_TIMESTAMP, UPDATED = CURRENT_TIMESTAMP;\n\ninsert into BRAND (CODE, NAME, COORDINATOR_ID, CREATED_BY, UPDATED_BY)\nselect \'DARE\', \'DARE\', id, \'Jurgen Appelo\', \'Jurgen Appelo\'\nfrom PERSON where EMAIL_ADDRESS = \'jurgen@noop.nl\' LIMIT 1;\n\ninsert into BRAND (CODE, NAME, COORDINATOR_ID, CREATED_BY, UPDATED_BY)\nselect \'HMEX\', \'Happy Melly Express\', id, \'Jurgen Appelo\', \'Jurgen Appelo\'\nfrom PERSON where EMAIL_ADDRESS = \'jurgen@noop.nl\' LIMIT 1;\n\ninsert into BRAND (CODE, NAME, COORDINATOR_ID, CREATED_BY, UPDATED_BY)\nselect \'COSUP\', \'Collaboration Superpowers\', id, \'Jurgen Appelo\', \'Jurgen Appelo\'\nfrom PERSON where EMAIL_ADDRESS = \'jurgen@noop.nl\' LIMIT 1;\n\ninsert into BRAND (CODE, NAME, COORDINATOR_ID, CREATED_BY, UPDATED_BY)\nselect \'BXLXS\', \'Business XL/XS\', id, \'Jurgen Appelo\', \'Jurgen Appelo\'\nfrom PERSON where EMAIL_ADDRESS = \'jurgen@noop.nl\' LIMIT 1;\n\ncreate unique index IDX_CODE on BRAND(CODE);','alter table BRAND drop column CREATED;\nalter table BRAND drop column CREATED_BY;\nalter table BRAND drop column UPDATED;\nalter table BRAND drop column UPDATED_BY;\nalter table BRAND modify CODE VARCHAR(254) ;\ndrop index IDX_CODE on BRAND;','applied',''),(15,'c0e4719a428848ba0357644b8485a47ce4035c2f','2015-03-16 12:44:02','update BRAND set UPDATED = CURRENT_TIMESTAMP where UPDATED = \'0000-00-00 00:00:00\';','','applied',''),(16,'f2023ddd5251a83015eece154a614c0107bed67a','20