RS_OF_EXPERIENCE;','drop table if exists MGT30_OLD_EVALUATION;\nalter table FACILITATOR drop column YEARS_OF_EXPERIENCE;\nalter table FACILITATOR drop column NUMBER_OF_EVENTS;','applied',''),(106,'ff96724f906d9408e9aa9ff99af6072be658fe58','2015-10-07 06:43:58','alter table FACILITATOR change column RATING PUBLIC_RATING float(6,2) default 0.0;\nalter table FACILITATOR add column PRIVATE_RATING float(6,2) default 0.0;\nalter table FACILITATOR add column PUBLIC_MEDIAN float(6,2) default 0.0;\nalter table FACILITATOR add column PRIVATE_MEDIAN float(6,2) default 0.0;\nalter table FACILITATOR add column PUBLIC_NPS float(6,2) default 0.0;\nalter table FACILITATOR add column PRIVATE_NPS float(6,2) default 0.0;\nalter table FACILITATOR add column NUMBER_OF_PUBLIC_EVALUATIONS int default 0;\nalter table FACILITATOR add column NUMBER_OF_PRIVATE_EVALUATIONS int default 0;\nalter table MGT30_OLD_EVALUATION drop column EVENT_ID;','alter table FACILITATOR change column PUBLIC_RATING RATING float(6,2) default 0.0;\nalter table FACILITATOR drop column PRIVATE_RATING;\nalter table FACILITATOR drop column PUBLIC_MEDIAN;\nalter table FACILITATOR drop column PRIVATE_MEDIAN;\nalter table FACILITATOR drop column PUBLIC_NPS;\nalter table FACILITATOR drop column PRIVATE_NPS;\nalter table FACILITATOR drop column NUMBER_OF_PUBLIC_EVALUATIONS;\nalter table FACILITATOR drop column NUMBER_OF_PRIVATE_EVALUATIONS;\nalter table MGT30_OLD_EVALUATION add column EVENT_ID bigint not null;','applied',''),(107,'c1004e2c50d96e40685f1bdfe68cbec8dfc09b0d','2015-10-14 19:21:44','alter table USER_ACCOUNT add column COORDINATOR tinyint(1) default 0;\nalter table USER_ACCOUNT add column FACILITATOR tinyint(1) default 0;\nalter table USER_ACCOUNT add column ACTIVE_ROLE tinyint(1) default 0;\n\nupdate USER_ACCOUNT, BRAND_COORDINATOR set COORDINATOR = 1 where USER_ACCOUNT.PERSON_ID = BRAND_COORDINATOR.PERSON_ID;\nupdate USER_ACCOUNT, LICENSE set FACILITATOR = 1 where USER_ACCOUNT.PERSON_ID = LICENSE.LICENSEE_ID;\nupdate USER_ACCOUNT set ACTIVE_ROLE = 1 where COORDINATOR = 1;','alter table USER_ACCOUNT drop column COORDINATOR;\nalter table USER_ACCOUNT drop column FACILITATOR;\nalter table USER_ACCOUNT drop column ACTIVE_ROLE;','applied',''),(108,'26a9c073b121ced06cf9f4fb1c0d4ab29d7a9b5b','2015-11-02 12:17:51','alter table USER_ACCOUNT add column ADMIN tinyint(1) default 0 after FACILITATOR;\nalter table USER_ACCOUNT add column MEMBER tinyint(1) default 0 after ADMIN;\nalter table USER_ACCOUNT add column REGISTERED tinyint(1) default 0 after MEMBER;\n\nupdate USER_ACCOUNT set REGISTERED = 1 where COORDINATOR = 1;\nupdate USER_ACCOUNT set REGISTERED = 1 where FACILITATOR = 1;\nupdate USER_ACCOUNT a, MEMBER m set a.MEMBER = 1, a.REGISTERED = 1 where a.PERSON_ID = m.OBJECT_ID and m.PERSON = 1;','alter table USER_ACCOUNT drop column ADMIN;\nalter table USER_ACCOUNT drop column MEMBER;\nalter table USER_ACCOUNT drop column REGISTERED;','applied','');
