INSERT INTO `PRODUCT` VALUES (1,'Management 3.0','Leading Agile Developers, Developing Agile Leaders','http://www.management30.com/product/management30/','When organizations adopt agile software development, not only developers and project managers need to learn new practices. Development managers and team leaders must also learn a different approach to leading and managing organizations.','http://www.management30.com/product/management30/','Buy Now!','products/241d1a55ffbfd51e02969c47b66fe04a82d63935.png','book',NULL,1,'2013-11-20 16:37:54','Peter Hilton','2014-09-08 16:56:08','Jurgen Appelo'),(2,'Happy Melly Teller','A backbone of Happy Melly ecosystem','http://teller.happymelly.com',NULL,NULL,NULL,'products/206d8ddb8a174aed04780bc43e1497ab30d165a2.png','apps',NULL,1,'2013-11-21 08:39:33','Sergei','2014-03-11 12:28:21','Hannu Heljala'),(3,'Lean Change Management','Innovative Practices for Organizational Change','http://leanchange.org/','This book will help you implement successful change and bypass change resistance by co-creating change. The book will do that through examples of how innovative practices can dramatically improve the success of change programs. These practices combine ideas from the Agile, Lean Startup, change management, organizational development and psychology communities. This book will change how you think about change.','http://leanchange.management','Buy Now','products/b6ebcbe6484b898a1fafe5401783a15194512a9a.png','book',3,1,'2013-12-17 12:30:43','Vasco Duarte','2015-07-07 16:05:03','jasonlittle'),(4,'Learning 3.0, Book 1','How Creative Workers Learn','http://learning30.co/','\"How Creative Workers Learn, the first book of Learning 3.0 series, takes you on a journey of discovery, you will understand how you can effectively manage your career, using learning as your tool to build a future you can be proud of. ','http://www.amazon.com/How-Creative-Workers-Learn-creativity-ebook/dp/B013K8K1CU/ref=sr_1_2?ie=UTF8&qid=1439940119&sr=8-2&keywords=learning+3.0','Pre-order','products/c7f14abf36d4214363cef21b49b7c1768c7ef3e7.png','book',NULL,1,'2013-12-17 12:38:50','Vasco Duarte','2015-08-19 15:13:42','Alexandre Magno'),(6,'Kudo Cards','A Management 3.0 game','http://www.management30.com/product/kudo-cards/','There are many wrong ways to reward employees. A simple but effective approach is the use of kudo cards, which enables people to give each other small tokens of appreciation.\r\n\r\nRead about the [Kudo Box](http://www.management30.com/workout/kudo-box/)','http://www.management30.com/product/kudo-cards/','Download Now!','products/72daaa4a1e0a5c1c9f66c729ec5549fa10e07b73.png','game',1,1,'2014-02-25 07:02:07','Sergey Kotlov','2014-03-17 20:27:40','Jurgen Appelo'),(7,'How to Change the World','Change Management 3.0','http://www.management30.com/product/how-to-change-the-world/','How do I deal with my crappy organization? I like my work but I don’t like what our management is doing. How do I deal with it?','http://www.management30.com/product/how-to-change-the-world/','Get the Book!','products/342cfad2686b8c72b2f220e50a84104d6686b607.png','book',NULL,1,'2014-02-25 07:02:37','Sergey Kotlov','2014-09-18 11:00:10','Jurgen Appelo'),(8,'Delegation Poker','A Management 3.0 game','http://www.management30.com/product/delegation-poker/','Delegation often comes down to ‘Either I do it, or you do it’. But in truth there are 7 levels of delegation. Use Delegation Poker to make clear who’s responsible for what and on what level.','http://www.management30.com/product/delegation-poker/','Download Now!','products/1ad606ba66d88ac7d9912b6d4f7de3a6265e4040.png','game',1,1,'2014-02-25 07:03:00','Sergey Kotlov','2014-09-18 10:55:12','Jurgen Appelo'),(9,'Moving Motivators','A Management 3.0 game','http://www.management30.com/product/moving-motivators/','Need to make a decision but unsure about the effects on your motivation? Want to know what motivates your colleagues? Hiring a new team member and need to know what makes her tick? Play Moving Motivators!','http://www.management30.com/product/moving-motivators/','Download Now!','products/ed00357e7896689fa9c56fc76749fd7c2191cfc0.png','game',1,1,'2014-02-25 07:03:30','Sergey Kotlov','2014-03-17 20:32:14','Jurgen Appelo'),(10,'Meddlers','A Management 3.0 game','http://www.management30.com/product/meddlers/','A very popular exercise is the Meddlers game (named after a very popular German board game). The exercise allows players to visualize and discuss organizational structures.','http://www.management30.com/product/meddlers/','Download Now!','products/64fa457008bb78d6ad0daeb267efba83774a8222.png','game',1,1,'2014-02-25 07:04:02','Sergey Kotlov','2014-03-17 20:31:22','Jurgen Appelo'),(11,'Dare Festival','More Happy Workers!','http://darefest.org','A Dare Festival is not about IT, HR, or Strategy.\r\nIt\'s about your organization and how you can help shape it.\r\n\r\nDo you like to feel happy at work?\r\nDo you like to do meaningful work?\r\nDo you believe management is not just for managers?\r\nWell, we think you will love Dare Festival. \r\nAn event for the whole organization.\r\n\r\nDo you dare to find out?','http://darefest.org','Attend Dare Festival','products/a99c8a37b462b4293cf1ed09b174bca3a9965676.png','conference',NULL,0,'2014-02-25 19:34:48','Maarten Volders','2014-03-31 04:42:46','Maarten Volders'),(12,'Dare Devils',NULL,'http://daredevils.be',NULL,NULL,NULL,'products/b24323d47d564ab0740d5aee2785583139f3953e.png','conference',NULL,0,'2014-02-25 19:35:53','Maarten Volders','2014-12-10 03:33:08','Sergey Kotlov'),(13,'Kudobox','Easy and fun way to say thank you','http://kudobox.co','*Kudobox* is a simple and fun service for sending #kudo cards in a matter of secods. The cards could be instantly shared on Twitter or sent by any other communication channel like email or Skype ','http://kudobox.co','Say Thank You Now','products/3f259db0b8a0b09598c444f1eff01604a50b7819.png','apps',NULL,1,'2014-03-19 06:43:41','Sergey Kotlov','2014-03-19 06:46:16','Sergey Kotlov'),(14,'Teamfeedback App','The 360° Teamfeedback Review That Works','http://teamfeedback.happymelly.com/','The most honest, fair, blind-spot-free and objective reviews are regular 360° team feedback reviews. If only they weren’t so time consuming. Well, they aren’t any longer with the Teamfeedback App.\r\n\r\nWith this smart review-app teams can start improving right away, based on the best possible information that’s available as frequently and often as they need it. With almost no effort in collecting it.','https://app.peerup.ch/Account/Register#/','Start your Teamfeedback survey Now! ','products/91e886992a7f634df723df0813f263e5909a08e4.png','apps',NULL,0,'2014-03-19 09:32:45','Mischa Ramseyer','2015-02-08 15:43:10','Philipp Engstler'),(15,'#Workout','Engage People, Improve Work, Delight Clients','http://www.management30.com/workouts/','In agile organizations managers are expected to be “servant leaders” and “systems thinkers”, but nobody explains exactly how to do this on a Monday morning. ”Empowering workers” and “Delighting customers” is crucial, but it’s not concrete. Managers, and everyone else, need to know “how” because most organizational problems are management problems.\r\n\r\n- How can we measure team performance?\r\n- How can we decide on salaries and bonuses?\r\n- How can we define job titles and career paths?\r\n- How can we replace performance appraisals?\r\n- How can we motivate our workers?\r\n- How can we change the organization’s culture?\r\n- How can we modernize management?\r\n\r\nThe book Management 3.0 Workout offers concrete practices, tools, and games for all workers so they can introduce **better management, with fewer managers**.','http://www.management30.com/workouts/list/','Download for FREE!','products/502e46ab69556c02fa8e43758ecf20ab0d8a84f0.png','book',1,1,'2014-05-02 10:21:26','Jurgen Appelo','2015-05-09 16:40:21','Jurgen Appelo'),(16,'Merit Money online app','Jurgen Appelo’s Merit-Money approach from his Management 3.0 workout book - Fast, secure and easy - Setup your Merit-Money survey now!','http://meritmoney.happymelly.com/','Paying people for work, without destroying their motivation, is one of the most difficult challenges for management. Regrettably, most compensation systems are unfair and unscientific. That’s why it would be wise to consider some lesser known alternatives that are based on real merits instead of imagined earnings.\r\n\r\nSee more at: [Merit-Money App](www.peerup.ch/Merit-Money \"peerUp Merit Money App\")\r\n\r\n\r\nSign up, Invite your team mates, see results immediately. ','https://app.peerup.ch/Account/Register#/','Create your Merit-Money Survey Now!','products/8273452eafd411805bfd202bf24ce21d03a5eaf9.png','apps',NULL,0,'2014-09-12 09:00:07','Mischa Ramseyer','2015-02-08 15:24:20','Philipp Engstler'),(17,'Collaboration Superpowers','Stories of remote teams doing great things','http://www.collaborationsuperpowers.com/about-the-book/','Packed with stories and tips for those whose business models depend upon successfully bridging distance to accomplish knowledge work.  We have interviewed early adopters and bring you their lessons learned.  Pre-ordering includes invitations to periodic hangouts on air with our interview subjects where you can learn to access and hone your collaboration superpowers.','http://www.collaborationsuperpowers.com/about-the-book/','Preorder the book','products/4cb4165d6dee10520eaa47ea9c5a51593b278890.png','book',NULL,1,'2014-09-12 15:08:17','Lisette Sutherland','2014-09-12 15:08:17','Lisette Sutherland'),(18,'Robot Melly ','Happy telepresence robots - Happy remote workers','http://www.happymelly.com.au','Remote working can be improved with technology. Use our telepresence robot to  engage with remote workers at dispersed workplaces.  ','http://www.happymelly.com.au/contact/','Find Out More','products/a3511f11b0e5b17516deb9bde32c3ced3891536f.png','apps',NULL,0,'2014-09-23 05:22:37','Anton Rossouw','2014-10-16 04:56:23','Anton Rossouw'),(19,'Improv Cards','A Management 3.0 game','http://www.management30.com/product/improv-cards/','As their name suggests, you can do whatever you want with these cards. It’s all about helping your team improvise and come up with more ideas and share stories. You could also call them story-telling cards.','http://www.management30.com/product/improv-cards/','Download Now!','products/49e25e264a5ad62bf7395fe2826ee6ff538df643.png','game',1,1,'2015-05-09 16:37:33','Jurgen Appelo','2015-05-09 16:37:33','Jurgen Appelo'),(20,'Lean Change Agent','Learn how to apply Agile and Lean practices to organizational change','http://leanchange.org/workshop','As a change agent, I’m sure you’ve experienced how difficult it can be to introduce change into an organization. That could mean you’re an Agile Coach or Scrum Master tasked with introducing Agile, and it can also mean you’re a Change Management Professional who is looking for more effective ways to develop and execute change programs.\r\n\r\nThis 2-day workshop, based on the book Lean Change Management,  is designed to help you discover more effective practices for introducing, and managing change in your organization.  You’ll learn by doing, not by reading PowerPoint slides! You’ll hear real stories about how to apply better, innovative practices to managing change.','http://leanchange.org/workshop','Find a Workshop','products/6ec81cf2128a2900a2178b5c80022cb2a6e28b01.png','course',3,1,'2015-07-07 16:07:54','jasonlittle','2015-07-07 16:07:54','jasonlittle'),(21,'Learning Camp','Become a Learning 3.0 Facilitator ','camp.learning30.co','One Weekend. Endless Opportunities.\r\nBecome a Learning 3.0 Facilitator and be part of the revolution behind knowledge creation among workers, teams, organisations...and society.','http://camp.learning30.co','JOIN US','products/f04e8059444504c78a27e9b78851c52f32e52d82.png','course',4,1,'2015-08-18 23:42:41','Alexandre Magno','2015-08-19 00:22:15','Alexandre Magno'),(22,'Learning Canvas','A Learning 3.0 Tool','http://www.learning30.co/wp/wp-content/uploads/2014/03/L30_LearningCanvas_v1EN.pdf','The Learning Canvas is one of the most popular Learning 3.0 tools. With its focus on asking for solutions and promoting sharing among participants, it allows learning to flow, producing solutions to problems through emergent learning. ','http://www.learning30.co/wp/wp-content/uploads/2014/03/L30_LearningCanvas_v1EN.pdf','Download now','products/dfdfc83c843a5a82cdb6e8b5f681687e3271ea94.png','game',4,1,'2015-08-19 00:04:52','Alexandre Magno','2015-08-22 19:29:16','Alexandre Magno');
